if not exists (select * from sys.tables where name = N'Solutions')
begin
	create table Solutions
	(
		SolutionId int identity not null,
		SolutionGlobalId uniqueidentifier not null,
		SolutionType smallint not null,
		ApplicationId tinyint,
		FileName nvarchar(260) collate Latin1_General_CI_AS_KS_WS,
		Publisher nvarchar(128),
		CLSID uniqueidentifier,
		ProgId nvarchar(255),

		MaskedFileName as (case when SolutionType in (0, 1) and (CHARINDEX(N'*', (FileName)) > 0) then FileName else null end),
		MaskedFileDisplayNumber int not null default 1,

		constraint PK_Solutions primary key clustered ( SolutionId ),
		constraint IX_Solutions_SolutionGlobalId unique nonclustered ( SolutionGlobalId )
	)
end
else
begin

	if (SELECT C.collation_name FROM sys.columns C INNER JOIN sys.tables T on T.object_id = C.object_id WHERE T.name = (N'Solutions') AND C.name = (N'FileName')) <> N'Latin1_General_CI_AS_KS_WS'
	begin
		if (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Solutions' AND C.name = N'MaskedFileName')) 
		begin
			if exists (select * from sys.indexes where name = N'IX_Solutions_MaskedFileName')
			begin
				drop index Solutions.IX_Solutions_MaskedFileName
			end
			alter table Solutions drop column MaskedFileName
		end
		alter table Solutions alter column FileName nvarchar(260) collate Latin1_General_CI_AS_KS_WS
	end

	if not (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Solutions' AND C.name = N'MaskedFileName'))
	begin
		alter table Solutions add MaskedFileName as (case when SolutionType in (0, 1) and (CHARINDEX(N'*', (FileName)) > 0) then FileName else null end)
	end

	if not (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Solutions' AND C.name = N'MaskedFileDisplayNumber'))
	begin
	    alter table Solutions add MaskedFileDisplayNumber int not null default 1
	end

	alter table Solutions alter column ProgId nvarchar(255)
end
go

if not exists (select * from sys.indexes where name = N'IX_Solutions_MaskedFileName')
begin
	create nonclustered index IX_Solutions_MaskedFileName on Solutions ( MaskedFileName, MaskedFileDisplayNumber )
end
go

