if not exists (select * from sys.tables where name = N'Computers')
begin
	create table Computers
	(
		ComputerId int identity not null,
		ComputerName nvarchar(15) collate Latin1_General_CI_AS_KS_WS not null,
		ComputerDomain nvarchar(255) collate Latin1_General_CI_AS_KS_WS not null,
		AgentVersionMajor smallint not null,
		AgentVersionMinor smallint not null,
		AgentVersionBuild smallint not null,
		AgentVersionRevision smallint not null,

		ProcessorName nvarchar(80) not null,
		NumProcessorsLogical smallint not null,
		NumProcessorsPhysical smallint not null,
		CpuArchitecture tinyint not null,
		MemoryInMB int not null,
		ScreenHeight int not null,
		ScreenWidth int not null,

		OSVersionMajor smallint not null,
		OSVersionMinor smallint not null,
		OSVersionBuild smallint not null,
		OSProductType smallint not null,

		OSDefaultLangId smallint not null,
		OSDefaultUILangId smallint not null,

		IEVersionMajor smallint not null,
		IEVersionMinor smallint not null,
		IEVersionBuild smallint not null,
		IEVersionRevision smallint not null,

		constraint PK_Computers primary key clustered ( ComputerId ),
	)
end
else
begin

	if not (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Computers' AND C.name = N'OSProductType'))
	begin		
		alter table Computers add OSProductType smallint not null default 0
		alter table Computers alter column OSProductType smallint not null
	end

	if (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T on T.object_id = C.object_id INNER JOIN sys.types TY on TY.system_type_id = C.system_type_id WHERE T.name = N'Computers' AND C.name = N'ComputerName' AND TY.name = N'varchar'))
	begin
		IF (EXISTS (SELECT * FROM sys.indexes I WHERE I.name = N'IX_Computers_ComputerName_ComputerDomain')) BEGIN ALTER TABLE Computers DROP CONSTRAINT IX_Computers_ComputerName_ComputerDomain; END;

		alter table Computers alter column ComputerName nvarchar(15) collate Latin1_General_CI_AS_KS_WS not null;
	end

	if (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T on T.object_id = C.object_id INNER JOIN sys.types TY on TY.system_type_id = C.system_type_id WHERE T.name = N'Computers' AND C.name = N'ComputerDomain' AND TY.name = N'varchar'))
	begin
		IF (EXISTS (SELECT * FROM sys.indexes I WHERE I.name = N'IX_Computers_ComputerName_ComputerDomain')) BEGIN ALTER TABLE Computers DROP CONSTRAINT IX_Computers_ComputerName_ComputerDomain; END;

		alter table Computers alter column ComputerDomain nvarchar(255) collate Latin1_General_CI_AS_KS_WS not null;
	end
end
go

IF NOT (EXISTS (SELECT * FROM sys.indexes I WHERE I.name = N'IX_Computers_ComputerName_ComputerDomain')) BEGIN ALTER TABLE Computers ADD CONSTRAINT IX_Computers_ComputerName_ComputerDomain unique nonclustered ( ComputerName, ComputerDomain ); END;
go

if not exists (select * from sys.tables where name = N'UsersOnComputers')
begin
	create table UsersOnComputers
	(
		UserId int not null,
		ComputerId int not null,

		WindowsUserDefaultLangId smallint,
		WindowsUserDefaultUILangId smallint,
		LastScanTime smalldatetime not null,
		LastUpdatedTime smalldatetime not null,		
		FileShare nvarchar(260) not null,
		DataProcessorName nvarchar(15) collate Latin1_General_CI_AS_KS_WS not null,

		constraint PK_UsersOnComputers primary key clustered ( UserId, ComputerId )
	)
end
else
begin

	if not (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'UsersOnComputers' AND C.name = N'LastUpdatedTime'))
	begin		
		alter table UsersOnComputers add LastUpdatedTime smalldatetime;

		if (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Computers' AND C.name = N'LastUpdatedTime'))
		begin
			exec(N'update UsersOnComputers
				set
					LastUpdatedTime = C.LastUpdatedTime
				from
					UsersOnComputers UOC
					inner join Computers C on C.ComputerId = UOC.ComputerId;');
		end;
		else
		begin
			exec(N'update UsersOnComputers set LastUpdatedTime = ''1900-01-01'';');
		end;

		alter table UsersOnComputers alter column LastUpdatedTime smalldatetime not null;
	end;

	if not (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'UsersOnComputers' AND C.name = N'FileShare'))
	begin		
		alter table UsersOnComputers add FileShare nvarchar(260);

		if (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Computers' AND C.name = N'FileShare'))
		begin
			exec(N'update UsersOnComputers
				set
					FileShare = C.FileShare
				from
					UsersOnComputers UOC
					inner join Computers C on C.ComputerId = UOC.ComputerId;');
		end;
		else
		begin
			exec(N'update UsersOnComputers set FileShare = '''';');
		end;

		alter table UsersOnComputers alter column FileShare nvarchar(260) not null;
	end;

	if not (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'UsersOnComputers' AND C.name = N'DataProcessorName'))
	begin		
		alter table UsersOnComputers add DataProcessorName nvarchar(15) collate Latin1_General_CI_AS_KS_WS;

		if (EXISTS (SELECT * FROM sys.columns C INNER JOIN sys.tables T ON T.object_id = C.object_id WHERE T.name = N'Computers' AND C.name = N'DataProcessorName'))
		begin
			exec(N'update UsersOnComputers
				set
					DataProcessorName = C.DataProcessorName
				from
					UsersOnComputers UOC
					inner join Computers C on C.ComputerId = UOC.ComputerId;');
		end;
		else
		begin
			exec(N'update UsersOnComputers set DataProcessorName = '''';');
		end;

		alter table UsersOnComputers alter column DataProcessorName nvarchar(15) collate Latin1_General_CI_AS_KS_WS not null;
	end;
end
go

