create view VFilteredSolutions
as
	select
		*
	from
		Solutions S
	where
		(select count(distinct SI.UserId) from SolutionInstances SI where (SI.SolutionId = S.SolutionId))
			>= isnull((select IntValue from ServerSettings where Name = 'SolutionFilterThreshold'), 0)
