create view VEventInstancesLoadedSolutionsConcatenated
as
	select
		EventInstanceId = EI.EventInstanceId,

		LoadedSolutions = max(case EILS.LoadOrder when 1 then S.FileName else N'' end) +
			max(case EILS.LoadOrder when 2 then N', ' + S.FileName else N'' end) +
			max(case EILS.LoadOrder when 3 then N', ' + S.FileName else N'' end) +
			max(case EILS.LoadOrder when 4 then N', ' + S.FileName else N'' end) +
			max(case EILS.LoadOrder when 5 then N', ' + S.FileName else N'' end)
	from
		EventInstances EI
		inner join EventInstanceLoadedSolutions EILS on EILS.EventInstanceId = EI.EventInstanceId
		inner join Solutions S on S.SolutionId = EILS.SolutionId
	group by
		EI.EventInstanceId
