begin
	drop procedure IsSchemaCompatibleWithDataProcessorVersion
end
go

create procedure IsSchemaCompatibleWithDataProcessorVersion
	@isCompatible int output,

	@schemaChangeNumber int
as
begin
	set nocount on

	if @schemaChangeNumber between 51 and 55
	begin
		select @isCompatible = 1;
	end
	else
	begin
		select @isCompatible = 0;
	end

	return 0;
end
go

if exists (select * from sys.procedures where name=N'IsSchemaCompatibleWithUXVersion')
begin
	drop procedure IsSchemaCompatibleWithUXVersion
end
go

create procedure IsSchemaCompatibleWithUXVersion
	@interfaceVersion int
as
begin
	declare @isCompatible int;
	declare @reason int;

	set nocount on;

	select @isCompatible = 0;

	if @interfaceVersion between 9 and 13
	begin

		select @isCompatible = 1;
	end;
	else
	begin
		if @interfaceVersion < 9
		begin

			select @isCompatible = 2;
		end;
	end;

	select IsCompatible = @isCompatible				
	union all
	select 9	
	union all
	select 13;		

	return 0;
end;
go

