create procedure InsertTag
	@tagId int output,

	@tag nvarchar(64)
as
begin
	set nocount on

	select @tagId = null

	select @tagId = TagId
	from Tags with (xlock)
	where Tag = @tag

	if @tagId is null
	begin
		insert Tags ( Tag ) values ( @tag )
		select @tagId = @@identity
	end
end
