create procedure InsertOrUpdateUser
	@userId int output,

	@userName nvarchar(256),
	@userDomain nvarchar(15),
	@tag1 nvarchar(64),
	@tag2 nvarchar(64),
	@tag3 nvarchar(64),
	@tag4 nvarchar(64)
as
begin
	declare @rowCountResult int
	declare @tag1Id int
	declare @tag2Id int
	declare @tag3Id int
	declare @tag4Id int

	set nocount on

	select @userId = null

	exec InsertTag @tag1Id output, @tag1
	exec InsertTag @tag2Id output, @tag2
	exec InsertTag @tag3Id output, @tag3
	exec InsertTag @tag4Id output, @tag4

	update Users with (serializable)
	set
		Tag1Id = @tag1Id,
		Tag2Id = @tag2Id,
		Tag3Id = @tag3Id,
		Tag4Id = @tag4Id,

		@userId = UserId
	where
		UserName = @userName
		and UserDomain = @userDomain
	select @rowCountResult = @@rowcount

	if @rowCountResult = 0
	begin

		insert Users
		(
			UserName,
			UserDomain,
			Tag1Id,
			Tag2Id,
			Tag3Id,
			Tag4Id
		)
		values
		(
			@userName,
			@userDomain,
			@tag1Id,
			@tag2Id,
			@tag3Id,
			@tag4Id
		)
		select @userId = @@identity
	end
end
