if exists (select * from sys.procedures where name=N'ReportSolutionInstances')
begin
	drop procedure ReportSolutionInstances
end
go

create procedure ReportSolutionInstances
	@userId int,
	@computerId int,
	@solutionsXml nvarchar(max)
as
begin
	declare @errorResult int;
	declare @createdTransaction bit;
	declare @createdSavepoint bit;
	declare @hXml int;

	set nocount on;

	exec @errorResult = sp_xml_preparedocument @hXml output, @solutionsXml;
	if @errorResult = 0
	begin
		begin try
			declare @newSolutions table
			(
				SolutionId int,

				SolutionGlobalId uniqueidentifier,
				SolutionType smallint,
				ApplicationId tinyint,
				FileName nvarchar(260) collate Latin1_General_CI_AS_KS_WS,
				Publisher nvarchar(128),
				CLSID uniqueidentifier,
				ProgId nvarchar(255),

				MaskedFileDisplayNumber int,

				LastSeenTime smalldatetime,
				LastLoadedTime smalldatetime,
				FriendlyName nvarchar(128),
				Description nvarchar(256),
				FullPath nvarchar(260),
				LoadTimeInMilliseconds int,
				FileFormat smallint,
				Title nvarchar(128),
				Author nvarchar(128),
				LoadBehavior int,
				CpuArchitecture tinyint,
				VersionMajor smallint,
				VersionMinor smallint,
				VersionBuild smallint,
				VersionRevision smallint,
				FileSizeInBytes bigint,
				HasVba bit,
				HasOle bit,
				HasExternalDataConnections bit,
				HasActiveXControl bit,
				HasAssemblyReference bit,
				HasXmlSchema bit,
				HasXmlExpansionPack bit,
				LangId smallint,
				DefaultUILangId smallint
			);

			if @@trancount = 0
			begin
				begin tran;
				select @createdTransaction = 1;
			end;
			else
			begin
				save tran ReportSolutionInstances;
				select @createdSavepoint = 1;
			end;

			insert @newSolutions
			select
				null,	

				X.SolutionGlobalId,
				X.SolutionType,
				X.ApplicationId,
				X.FileName,
				X.Publisher,
				X.CLSID,
				X.ProgId,

				null,

				X.LastSeenTime,
				X.LastLoadedTime,
				X.FriendlyName,
				X.Description,
				X.FullPath,
				X.LoadTimeInMilliseconds,
				X.FileFormat,
				X.Title,
				X.Author,
				X.LoadBehavior,
				X.CpuArchitecture,
				X.VersionMajor,
				X.VersionMinor,
				X.VersionBuild,
				X.VersionRevision,
				X.FileSizeInBytes,
				X.HasVba,
				X.HasOle,
				X.HasExternalDataConnections,
				X.HasActiveXControl,
				X.HasAssemblyReference,
				X.HasXmlSchema,
				X.HasXmlExpansionPack,
				X.LangId,
				X.DefaultUILangId
			from
				openxml(@hXml, '/r/s', 1) with
				(
					SolutionGlobalId uniqueidentifier '@id',
					SolutionType smallint '@st',
					ApplicationId tinyint '@aid',
					FileName nvarchar(260) collate Latin1_General_CI_AS_KS_WS '@fn',
					Publisher nvarchar(128) '@p',
					CLSID uniqueidentifier '@cid',
					ProgId nvarchar(255) '@pid',

					LastSeenTime smalldatetime '@lst',
					LastLoadedTime smalldatetime '@llt',
					FriendlyName nvarchar(128) '@fr',
					Description nvarchar(256) '@d',
					FullPath nvarchar(260) '@fp',
					LoadTimeInMilliseconds int '@lt',
					FileFormat smallint '@ff',
					Title nvarchar(128) '@t',
					Author nvarchar(128) '@au',
					LoadBehavior int '@lb',
					CpuArchitecture tinyint '@cpu',
					VersionMajor smallint '@vm',
					VersionMinor smallint '@vn',
					VersionBuild smallint '@vb',
					VersionRevision smallint '@vr',
					FileSizeInBytes bigint '@sz',
					HasVba bit '@vba',
					HasOle bit '@ole',
					HasExternalDataConnections bit '@edc',
					HasActiveXControl bit '@ax',
					HasAssemblyReference bit '@ar',
					HasXmlSchema bit '@xs',
					HasXmlExpansionPack bit '@xep',
					LangId smallint '@lid',
					DefaultUILangId smallint '@ulid'
				) X;

			update @newSolutions
			set
				MaskedFileDisplayNumber = S.MaskedFileDisplayNumber
			from
				@newSolutions X
				inner join Solutions S on S.SolutionGlobalId = X.SolutionGlobalId
			where
				(S.FileName is not null) and (X.FileName is not null);

			with SolutionMaskedFileDisplayNumbers as
			(
				select
					X.SolutionGlobalId,
					RowNumber = row_number() over (partition by X.FileName order by LastSeenTime asc)
				from
					@newSolutions X
				where
					(X.FileName is not null)
					and (X.MaskedFileDisplayNumber is null)
					and (X.SolutionType in (0, 1))
			)
			update @newSolutions
			set
				MaskedFileDisplayNumber = isnull((select max(S2.MaskedFileDisplayNumber) from Solutions S2 where S2.MaskedFileName = X.FileName), 0) + isnull(SMFDN.RowNumber, 1)
			from
				@newSolutions X
				left outer join SolutionMaskedFileDisplayNumbers SMFDN on SMFDN.SolutionGlobalId = X.SolutionGlobalId
			where
				X.MaskedFileDisplayNumber is null;

			update Solutions with (tablock)
			set
				FileName = isnull(X.FileName, S.FileName),
				Publisher = isnull(X.Publisher, S.Publisher),
				MaskedFileDisplayNumber = X.MaskedFileDisplayNumber
			from
				Solutions S
				inner join @newSolutions X on X.SolutionGlobalId = S.SolutionGlobalId;

			insert Solutions
			(
				SolutionGlobalId,
				SolutionType,
				ApplicationId,
				FileName,
				Publisher,
				CLSID,
				ProgId,
				MaskedFileDisplayNumber
			)
			select
				X.SolutionGlobalId,
				X.SolutionType,
				X.ApplicationId,
				X.FileName,
				X.Publisher,
				X.CLSID,
				X.ProgId,
				X.MaskedFileDisplayNumber
			from
				@newSolutions X
			where
				not exists (select * from Solutions where SolutionGlobalId = X.SolutionGlobalId);

			update @newSolutions
			set
				SolutionId = S.SolutionId
			from
				@newSolutions X
				inner join Solutions S on S.SolutionGlobalId = X.SolutionGlobalId;

			update SolutionInstances
			set
				LastSeenTime = X.LastSeenTime,
				LastLoadedTime = X.LastLoadedTime,
				FriendlyName = X.FriendlyName,
				Description = X.Description,
				FullPath = X.FullPath,
				LoadTimeInMilliseconds = X.LoadTimeInMilliseconds,
				FileFormat = X.FileFormat,
				Title = X.Title,
				Author = X.Author,
				LoadBehavior = X.LoadBehavior,
				CpuArchitecture = X.CpuArchitecture,
				VersionMajor = X.VersionMajor,
				VersionMinor = X.VersionMinor,
				VersionBuild = X.VersionBuild,
				VersionRevision = X.VersionRevision,
				FileSizeInBytes = X.FileSizeInBytes,
				HasVba = X.HasVba,
				HasOle = X.HasOle,
				HasExternalDataConnections = X.HasExternalDataConnections,
				HasActiveXControl = X.HasActiveXControl,
				HasAssemblyReference = X.HasAssemblyReference,
				HasXmlSchema = X.HasXmlSchema,
				HasXmlExpansionPack = X.HasXmlExpansionPack,
				LangId = X.LangId,
				DefaultUILangId = X.DefaultUILangId
			from
				SolutionInstances SI
				inner join @newSolutions X on X.SolutionId = SI.SolutionId
			where
				SI.UserId = @userId
				and SI.ComputerId = @computerId;

			insert SolutionInstances
			(
				SolutionId,
				UserId,
				ComputerId,
				LastSeenTime,
				LastLoadedTime,
				FriendlyName,
				Description,
				FullPath,
				LoadTimeInMilliseconds,
				FileFormat,
				Title,
				Author,
				LoadBehavior,
				CpuArchitecture,
				VersionMajor,
				VersionMinor,
				VersionBuild,
				VersionRevision,
				FileSizeInBytes,
				HasVba,
				HasOle,
				HasExternalDataConnections,
				HasActiveXControl,
				HasAssemblyReference,
				HasXmlSchema,
				HasXmlExpansionPack,
				LangId,
				DefaultUILangId
			)
			select
				X.SolutionId,
				@userId,
				@computerId,
				X.LastSeenTime,
				X.LastLoadedTime,
				X.FriendlyName,
				X.Description,
				X.FullPath,
				X.LoadTimeInMilliseconds,
				X.FileFormat,
				X.Title,
				X.Author,
				X.LoadBehavior,
				X.CpuArchitecture,
				X.VersionMajor,
				X.VersionMinor,
				X.VersionBuild,
				X.VersionRevision,
				X.FileSizeInBytes,
				X.HasVba,
				X.HasOle,
				X.HasExternalDataConnections,
				X.HasActiveXControl,
				X.HasAssemblyReference,
				X.HasXmlSchema,
				X.HasXmlExpansionPack,
				X.LangId,
				X.DefaultUILangId
			from
				@newSolutions X
			where
				not exists (select * from SolutionInstances SI where SI.SolutionId = X.SolutionId and SI.UserId = @userId and SI.ComputerId = @computerId);

			delete SolutionInstanceHostAppDetails
			from
				SolutionInstanceHostAppDetails SIHAD
				inner join @newSolutions X on X.SolutionId = SIHAD.SolutionId
			where
				SIHAD.UserId = @userId
				and SIHAD.ComputerId = @computerId;

			insert SolutionInstanceHostAppDetails
			(
				SolutionId,
				UserId,
				ComputerId,
				HostAppVersionMajor,
				PolicySetting
			)
			select
				X.SolutionId,
				@userId,
				@computerId,
				Y.HostAppVersionMajor,
				Y.PolicySetting
			from
				openxml(@hXml, '/r/s/a', 1) with
				(
					SolutionGlobalId uniqueidentifier '../@id',
					HostAppVersionMajor smallint '@vm',
					PolicySetting tinyint '@p'
				) Y
				inner hash join @newSolutions X on X.SolutionGlobalId = Y.SolutionGlobalId;
		end try
		begin catch
			select @errorResult = ERROR_NUMBER();

			if @createdSavepoint = 1
			begin
				if xact_state() <> -1
				begin
					rollback tran ReportSolutionInstances;
				end;
			end;
			else if @createdTransaction = 1
			begin
				rollback tran;
				select @createdTransaction = null;
			end;
		end catch

		if @createdTransaction = 1
		begin
			commit tran;
		end;
	end;

	if @hXml is not null
	begin
		exec sp_xml_removedocument @hXml;
	end;

	return @errorResult;
end;
go

if exists (select * from sys.procedures where name=N'ReportEvents')
begin
	drop procedure ReportEvents
end
go

create procedure ReportEvents
	@userId int,
	@computerId int,

	@eventsXml nvarchar(max)
as
begin
	declare @errorResult int
	declare @createdTransaction bit
	declare @createdSavepoint bit
	declare @solutionId int
	declare @hXml int

	set nocount on
	set ansi_warnings off

	select @hXml = null

	exec @errorResult = sp_xml_preparedocument @hXml output, @eventsXml
	if @errorResult = 0
	begin
		begin try
			if @@trancount = 0
			begin
				begin tran
				select @createdTransaction = 1
			end
			else
			begin
				save tran ReportEvents
				select @createdSavepoint = 1
			end

			declare @tabNewEventInstances as table (
				EventInstanceGlobalId uniqueidentifier not null primary key,
				Timestamp datetime not null,
				EventType int not null,
				EventId int not null,
				SolutionId int,
				ContainerSolutionId int,
				SessionStartTime datetime,
				HostAppVersionMajor smallint,
				HostAppVersionMinor smallint,
				HostAppVersionBuild smallint,
				HostAppVersionRevision smallint
			)

			insert @tabNewEventInstances
			select
				X.EventInstanceGlobalId,
				X.Timestamp,
				X.EventType,
				X.EventId,
				S.SolutionId,
				CS.SolutionId,
				X.SessionStartTime,
				HostAppVersionMajor,
				HostAppVersionMinor,
				HostAppVersionBuild,
				HostAppVersionRevision
			from
				openxml(@hXml, '/r/e', 3) with
				(
					EventInstanceGlobalId uniqueidentifier '@id',
					Timestamp datetime '@ts',
					EventType int '@t',
					EventId int '@e',
					SolutionGlobalId uniqueidentifier '@s',
					ContainerSolutionGlobalId uniqueidentifier '@cs',
					SessionStartTime datetime '@se',
					HostAppVersionMajor smallint '@vm',
					HostAppVersionMinor smallint '@vn',
					HostAppVersionBuild smallint '@vb',
					HostAppVersionRevision smallint '@vr'
				) X
				left outer join Solutions S on S.SolutionGlobalId = X.SolutionGlobalId
				left outer join Solutions CS on CS.SolutionGlobalId = X.ContainerSolutionGlobalId;

			insert SolutionSessions
			(
				SolutionId,
				UserId,
				ComputerId,
				SessionStartTime,
				State
			)
			select
				X.SolutionId,
				@userId,
				@computerId,
				X.SessionStartTime,
				min(case when X.EventType in (1, 2, 3) then X.EventType else null end)
			from
				@tabNewEventInstances X
			where
				(X.SolutionId is not null)
				and (X.SessionStartTime is not null)
				and (not exists (select * from SolutionSessions SS where SS.UserId = @userId and SS.ComputerId = @computerId and SS.SolutionId = X.SolutionId and SS.SessionStartTime = X.SessionStartTime))
			group by
				X.SolutionId,
				X.SessionStartTime;

			insert SolutionSessionDetails
			(
				SolutionId,
				UserId,
				ComputerId,
				SessionStartTime,
				ContainerSolutionId
			)
			select
				X.SolutionId,
				@userId,
				@computerId,
				X.SessionStartTime,
				min(X.ContainerSolutionId)
			from
				@tabNewEventInstances X
			where
				(X.SolutionId is not null)
				and (X.SessionStartTime is not null)
				and (X.ContainerSolutionId is not null)
				and (not exists (select * from SolutionSessionDetails SS where SS.UserId = @userId and SS.ComputerId = @computerId and SS.SolutionId = X.SolutionId and SS.SessionStartTime = X.SessionStartTime))
			group by
				X.SolutionId,
				X.SessionStartTime;

			delete from @tabNewEventInstances
			where
				EventType = 0

			delete @tabNewEventInstances
			from
				@tabNewEventInstances X
				inner join EventInstances E on E.EventInstanceGlobalId = X.EventInstanceGlobalId

			insert EventInstances
			(
				EventInstanceGlobalId,
				UserId,
				ComputerId,
				Timestamp,
				EventType,
				EventId,
				SolutionId,
				SessionStartTime,
				HostAppVersionMajor,
				HostAppVersionMinor,
				HostAppVersionBuild,
				HostAppVersionRevision
			)
			select
				EventInstanceGlobalId,
				@userId,
				@computerId,
				Timestamp,
				EventType,
				EventId,
				SolutionId,
				SessionStartTime,
				HostAppVersionMajor,
				HostAppVersionMinor,
				HostAppVersionBuild,
				HostAppVersionRevision
			from
				@tabNewEventInstances

			update SolutionSessions
			set
				State = X.EventType
			from
				SolutionSessions SS
				inner join @tabNewEventInstances X on X.SessionStartTime = SS.SessionStartTime and X.SolutionId = SS.SolutionId
			where
				SS.UserId = @userId
				and SS.ComputerId = @computerId
				and X.EventType in (1, 2, 3)
				and ((SS.State is null) or (X.EventType < SS.State))

			insert EventInstanceLoadedSolutions
			(
				EventInstanceId,
				SolutionId,
				LoadOrder
			)
			select
				E.EventInstanceId,
				S.SolutionId,
				X.LoadOrder
			from
				openxml(@hXml, '/r/e/ls', 3) with
				(
					EventInstanceGlobalId uniqueidentifier '../@id',
					SolutionGlobalId uniqueidentifier '@id',
					LoadOrder int '@o'
				) X
				inner join EventInstances E on E.EventInstanceGlobalId = X.EventInstanceGlobalId
				inner join Solutions S on S.SolutionGlobalId = X.SolutionGlobalId
			where
				exists (select * from @tabNewEventInstances where EventInstanceGlobalId = X.EventInstanceGlobalId)
		end try
		begin catch
			select @errorResult = ERROR_NUMBER()

			if @createdSavepoint = 1
			begin
				if xact_state() <> -1
				begin
					rollback tran ReportEvents
				end
			end
			else if @createdTransaction = 1
			begin
				rollback tran
				select @createdTransaction = null
			end
		end catch

		if @createdTransaction = 1
		begin
			commit tran
		end;
	end

	if @hXml is not null
	begin
		exec sp_xml_removedocument @hXml
	end

	return @errorResult
end
go

if exists (select * from sys.procedures where name=N'ReportUserOnComputer')
begin
	drop procedure ReportUserOnComputer
end
go

create procedure ReportUserOnComputer
	@userId int output,
	@computerId int output,
	@newerDataAlreadyExists bit output,

	@userName nvarchar(256),
	@userDomain nvarchar(15),
	@tag1 nvarchar(64),
	@tag2 nvarchar(64),
	@tag3 nvarchar(64),
	@tag4 nvarchar(64),

	@computerName nvarchar(15),
	@computerDomain nvarchar(255),
	@agentVersionMajor smallint,
	@agentVersionMinor smallint,
	@agentVersionBuild smallint,
	@agentVersionRevision smallint,

	@processorName nvarchar(80),
	@numProcessorsLogical smallint,
	@numProcessorsPhysical smallint,
	@cpuArchitecture tinyint,
	@memoryInMB int,
	@screenHeight int,
	@screenWidth int,

	@osVersionMajor smallint,
	@osVersionMinor smallint,
	@osVersionBuild smallint,
	@osProductType smallint,

	@osDefaultLangId smallint,
	@osDefaultUILangId smallint,

	@ieVersionMajor smallint,
	@ieVersionMinor smallint,
	@ieVersionBuild smallint,
	@ieVersionRevision smallint,

	@windowsUserDefaultLangId smallint,
	@windowsUserDefaultUILangId smallint,
	@lastScanTime smalldatetime,
	@fileShare nvarchar(260),
	@dataProcessorName nvarchar(15)

as
begin
	declare @errorResult int
	declare @createdTransaction bit
	declare @createdSavepoint bit

	set nocount on

	select @errorResult = 0

	begin try
		declare @currentLastScanTime smalldatetime

		if @@trancount = 0
		begin
			begin tran
			select @createdTransaction = 1
		end
		else
		begin
			save tran ReportUserOnComputer
			select @createdSavepoint = 1
		end

		select
			@currentLastScanTime = UOC.LastScanTime,
			@userId = U.UserId,
			@computerId = C.ComputerId
		from
			UsersOnComputers UOC with (serializable)
			inner join Users U  with (serializable) on U.UserId = UOC.UserId
			inner join Computers C with (serializable) on C.ComputerId = UOC.ComputerId
		where
			U.UserName = @userName
			and U.UserDomain = @userDomain
			and C.ComputerName = @computerName
			and C.ComputerDomain = @computerDomain

		if (@currentLastScanTime is null) or (@currentLastScanTime <= @lastScanTime)
		begin

			select @newerDataAlreadyExists = 0

			exec InsertOrUpdateUser
				@userId output,
				@userName,
				@userDomain,
				@tag1,
				@tag2,
				@tag3,
				@tag4

			exec InsertOrUpdateComputer
				@computerId output,
				@computerName,
				@computerDomain,
				@agentVersionMajor,
				@agentVersionMinor,
				@agentVersionBuild,
				@agentVersionRevision,

				@processorName,
				@numProcessorsLogical,
				@numProcessorsPhysical,
				@cpuArchitecture,
				@memoryInMB,
				@screenHeight,
				@screenWidth,

				@osVersionMajor,
				@osVersionMinor,
				@osVersionBuild,
				@osProductType,

				@osDefaultLangId,
				@osDefaultUILangId,

				@ieVersionMajor,
				@ieVersionMinor,
				@ieVersionBuild,
				@ieVersionRevision

			exec InsertOrUpdateUserOnComputer
				@userId,
				@computerId,
				@windowsUserDefaultLangId,
				@windowsUserDefaultUILangId,
				@lastScanTime,
				@fileShare,
				@dataProcessorName
		end
		else
		begin

			select @newerDataAlreadyExists = 1
		end
	end try
	begin catch
		select @errorResult = ERROR_NUMBER()

		if @createdSavepoint = 1
		begin
			if xact_state() <> -1
			begin
				rollback tran ReportUserOnComputer
			end
		end
		else if @createdTransaction = 1
		begin
			rollback tran
			select @createdTransaction = null
		end
	end catch

	if @createdTransaction = 1
	begin
		commit tran
	end

	return @errorResult
end
go

