create procedure UpdateOfficeDeploymentStatusSnapshots
as
begin
	set nocount on;

	insert OfficeDeploymentStatusSnapshots
	(
		Timestamp,
		Tag1Id,
		Tag2Id,
		Tag3Id,
		Tag4Id,
		VersionMajor,
		NumUsers
	)
	select
		Timestamp = getutcdate(),
		U.Tag1Id,
		U.Tag2Id,
		U.Tag3Id,
		U.Tag4Id,
		SI.VersionMajor,
		count(distinct U.UserId)
	from
		Users U
		inner join SolutionInstances SI on SI.UserId = U.UserId
		inner join Solutions S  on S.SolutionId = SI.SolutionId
		inner join UsersOnComputers UOC on UOC.UserId = SI.UserId and UOC.ComputerId = SI.ComputerId
	where
		S.SolutionType = 6

		and SI.LastSeenTime >= UOC.LastScanTime
		and SI.LastSeenTime >= dateadd(day, -90, getutcdate())
	group by
		U.Tag1Id,
		U.Tag2Id,
		U.Tag3Id,
		U.Tag4Id,
		SI.VersionMajor;
end
