if exists (select * from sys.procedures where name=N'UpdateSolutionHealthSnapshots')
begin
	drop procedure UpdateSolutionHealthSnapshots
end
go

create procedure UpdateSolutionHealthSnapshots
as
begin
	declare @solutionFilterThreshold int;
	declare @showBuiltInSolutionsOnOverview int;
	declare @resolution tinyint;
	declare @timestamp datetime;

	set nocount on;

	select 
		@solutionFilterThreshold = isnull((select IntValue from ServerSettings where Name = 'SolutionFilterThreshold'), 0),
		@showBuiltInSolutionsOnOverview = isnull((select IntValue from ServerSettings where Name = 'ShowBuiltInSolutionsOnOverview'), 0);

	select @timestamp = getutcdate();
	select @resolution = 1;

	while @resolution <= 3
	begin
		declare @startDate datetime;
		declare @expirationDate datetime;

		select @startDate = (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * 1, @timestamp) WHEN 1 THEN DATEADD(DAY, -7 * 1, @timestamp) WHEN 2 THEN DATEADD(MONTH, -1 * 1, @timestamp) WHEN 3 THEN DATEADD(MONTH, -3 * 1, @timestamp) WHEN 4 THEN DATEADD(MONTH, -6 * 1, @timestamp) ELSE DATEADD(YEAR, -1 * 1, @timestamp) END);
		select @expirationDate = (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * 4, @timestamp) WHEN 1 THEN DATEADD(DAY, -7 * 4, @timestamp) WHEN 2 THEN DATEADD(MONTH, -1 * 4, @timestamp) WHEN 3 THEN DATEADD(MONTH, -3 * 4, @timestamp) WHEN 4 THEN DATEADD(MONTH, -6 * 4, @timestamp) ELSE DATEADD(YEAR, -1 * 4, @timestamp) END);

		with _SolutionViews as
		(
			select
				S.SolutionId,
				S.ApplicationId,
				ViewType = (case when S.SolutionType in (0, 1) then 0 else 1 end)
			from
				Solutions S
			where
				S.SolutionType in (0, 1, 2, 3, 4)
				and (select count(distinct SI.UserId) from SolutionInstances SI where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold

				and ((@showBuiltInSolutionsOnOverview = 1)
					or (not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
						and not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId)))
		),
		_SolutionStatsPerTagCombination as
		(
			select
				SV.ViewType,
				U.Tag1Id,
				U.Tag2Id,
				U.Tag3Id,
				U.Tag4Id,
				SS.SolutionId,
				RowNumber = row_number() over (partition by U.Tag1Id, U.Tag2Id, U.Tag3Id, U.Tag4Id, SV.ViewType order by count(*) desc, SS.SolutionId asc),
				NumSessions = count(*),
				NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)	
			from
				Users U
				inner join SolutionSessions SS on SS.UserId = U.UserId
				inner join _SolutionViews SV on SV.SolutionId = SS.SolutionId
			where
				SS.SessionStartTime >= @startDate
				and SS.SessionStartTime < @timestamp
				and (SV.ApplicationId in (0, 1, 2, 4))
			group by
				SV.ViewType,
				U.Tag1Id,
				U.Tag2Id,
				U.Tag3Id,
				U.Tag4Id,
				SS.SolutionId
		)
		insert SolutionHealthSnapshots
		(
			Timestamp,
			Resolution,
			ViewType,
			Tag1Id,
			Tag2Id,
			Tag3Id,
			Tag4Id,
			SolutionId,
			NumSessions,
			NumSuccessfulSessions
		)
		select
			Timestamp = @timestamp,
			Resolution = @resolution,
			ViewType,
			SSPTC.Tag1Id,
			SSPTC.Tag2Id,
			SSPTC.Tag3Id,
			SSPTC.Tag4Id,
			SSPTC.SolutionId,
			SSPTC.NumSessions,
			SSPTC.NumSuccessfulSessions
		from
			_SolutionStatsPerTagCombination SSPTC
		where
			SSPTC.RowNumber <= (case when SSPTC.ViewType = 0 then 400 else 100 end);

		delete from SolutionHealthSnapshots
		where
			Resolution = @resolution
			and Timestamp <= @expirationDate;

		select @resolution = @resolution + 1;
	end;
end
go

if exists (select * from sys.procedures where name=N'UpdateSolutionSummariesPerUser')
begin
	drop procedure UpdateSolutionSummariesPerUser
end
go

create procedure UpdateSolutionSummariesPerUser
	@solutionIdStart int,
	@solutionIdEnd int
as
begin
	set nocount on;

	declare @resolution tinyint;
	declare @timestamp datetime;

	select @timestamp = getutcdate();
	select @resolution = 3;

	declare @startDateYear datetime;
	declare @startDate6Months datetime;
	declare @startDate3Months datetime;

	create table [#solutionSummariesPerUser]
	(
		Resolution tinyint not null,
		SolutionId int not null,
		UserId int not null,

		HasCriticalIssues bit not null,
		HasNoncriticalIssues bit not null,

		NumSessions int not null,
		NumSuccessfulSessions int not null,
		NumSessionsForTrend int not null,
		NumSuccessfulSessionsForTrend int not null,
		OldNumSessionsForTrend int not null,
		OldNumSuccessfulSessionsForTrend int not null,

		IsO11User bit not null,
		IsO12User bit not null,
		IsO14User bit not null,
		IsO15User bit not null,
		IsO16User bit not null,

		constraint PK_temp_SolutionSummariesPerUser primary key clustered ( Resolution, SolutionId, UserId )
	);

	while @resolution <= 5
	begin
		declare @startDate datetime;
		declare @expirationDate datetime;

		select @startDate = (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * 1, @timestamp) WHEN 1 THEN DATEADD(DAY, -7 * 1, @timestamp) WHEN 2 THEN DATEADD(MONTH, -1 * 1, @timestamp) WHEN 3 THEN DATEADD(MONTH, -3 * 1, @timestamp) WHEN 4 THEN DATEADD(MONTH, -6 * 1, @timestamp) ELSE DATEADD(YEAR, -1 * 1, @timestamp) END);

		with _SolutionUsers as
		(
			select
				SI.SolutionId,
				SI.UserId,
				IsO11User = max(case SIHAD.HostAppVersionMajor when 11 then 1 else 0 end),
				IsO12User = max(case SIHAD.HostAppVersionMajor when 12 then 1 else 0 end),
				IsO14User = max(case SIHAD.HostAppVersionMajor when 14 then 1 else 0 end),
				IsO15User = max(case SIHAD.HostAppVersionMajor when 15 then 1 else 0 end),
				IsO16User = max(case SIHAD.HostAppVersionMajor when 16 then 1 else 0 end)

			from
				SolutionInstances SI
				left outer hash join SolutionInstanceHostAppDetails SIHAD on SIHAD.SolutionId = SI.SolutionId and SIHAD.UserId = SI.UserId and SIHAD.ComputerId = SI.ComputerId
			where
				SI.LastSeenTime > @startDate
			group by
				SI.SolutionId,
				SI.UserId
		),
		_EventSummaries as
		(
			select
				EI.SolutionId,
				EI.UserId,
				HasCriticalIssues = max(case when EI.EventType = 1 then 1 else 0 end),
				HasNoncriticalIssues = max(case when EI.EventType = 1 then 0 else 1 end)
			from
				EventInstances EI
			where
				EI.Timestamp > @startDate
			group by
				EI.SolutionId,
				EI.UserId
		),

		_SessionSummariesWeek as
		(
			select
				SS.SolutionId,
				SS.UserId,
				NumSessions = count(*),
				NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)
			from
				SolutionSessions SS
			where
				SS.SessionStartTime > dateadd(day, -7, @timestamp)
			group by
				SS.SolutionId,
				SS.UserId
		),
		_SessionSummariesWeekToStart as
		(
			select
				SS.SolutionId,
				SS.UserId,
				NumSessions = count(*),
				NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)
			from

				SolutionSessions SS with (index (IX_SolutionSessions_SolutionId_SessionStartTime_UserId_ComputerId__State))
			where
				SS.SessionStartTime <= dateadd(day, -7, @timestamp)
				and SS.SessionStartTime > @startDate
			group by
				SS.SolutionId,
				SS.UserId
		),
		_SessionSummariesStartToStartPlusWeek as
		(
			select
				SS.SolutionId,
				SS.UserId,
				NumSessions = count(*),
				NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)
			from
				SolutionSessions SS
			where
				SS.SessionStartTime <= @startDate
				and SS.SessionStartTime > dateadd(day, -7, @startDate)
			group by
				SS.SolutionId,
				SS.UserId
		)
		insert [#solutionSummariesPerUser]
		(
			Resolution,
			SolutionId,
			UserId,

			HasCriticalIssues,
			HasNoncriticalIssues,

			NumSessions,
			NumSuccessfulSessions,
			NumSessionsForTrend,
			NumSuccessfulSessionsForTrend,
			OldNumSessionsForTrend,
			OldNumSuccessfulSessionsForTrend,

			IsO11User,
			IsO12User,
			IsO14User,
			IsO15User,
			IsO16User
		)
		select
			@resolution,
			SU.SolutionId,
			SU.UserId,

			isnull(ES.HasCriticalIssues, 0),
			isnull(ES.HasNoncriticalIssues, 0),

			isnull(SSWeek.NumSessions, 0) + isnull(SSStart.NumSessions, 0),
			isnull(SSWeek.NumSuccessfulSessions, 0) + isnull(SSStart.NumSuccessfulSessions, 0),
			isnull(SSWeek.NumSessions, 0),
			isnull(SSWeek.NumSuccessfulSessions, 0),
			isnull(SSStartToStartPlusWeek.NumSessions, 0),
			isnull(SSStartToStartPlusWeek.NumSuccessfulSessions, 0),

			isnull(SU.IsO11User, 0),
			isnull(SU.IsO12User, 0),
			isnull(SU.IsO14User, 0),
			isnull(SU.IsO15User, 0),
			isnull(SU.IsO16User, 0)
		from
			_SolutionUsers SU
			left outer hash join _EventSummaries ES on ES.SolutionId = SU.SolutionId and ES.UserId = SU.UserId
			left outer hash join _SessionSummariesWeek SSWeek on SSWeek.SolutionId = SU.SolutionId and SSWeek.UserId = SU.UserId
			left outer hash join _SessionSummariesWeekToStart SSStart on SSStart.SolutionId = SU.SolutionId and SSStart.UserId = SU.UserId
			left outer hash join _SessionSummariesStartToStartPlusWeek SSStartToStartPlusWeek on SSStartToStartPlusWeek.SolutionId = SU.SolutionId and SSStartToStartPlusWeek.UserId = SU.UserId
		where
			SU.SolutionId between @solutionIdStart and @solutionIdEnd
		option
			(hash group);

		select @resolution = @resolution + 1;
	end;

	create table [#distinctEventsPerSolutionPerUser]
	(
		SmallestResolution tinyint not null,
		SolutionId int not null,
		UserId int not null,
		EventId int not null,

		EventType int not null,

		constraint PK_temp_DistinctEventsPerSolutionPerUser primary key clustered ( SmallestResolution, SolutionId, EventId, UserId )
	);

	select @startDateYear = (CASE (5) WHEN 0 THEN DATEADD(DAY, -1 * 1, @timestamp) WHEN 1 THEN DATEADD(DAY, -7 * 1, @timestamp) WHEN 2 THEN DATEADD(MONTH, -1 * 1, @timestamp) WHEN 3 THEN DATEADD(MONTH, -3 * 1, @timestamp) WHEN 4 THEN DATEADD(MONTH, -6 * 1, @timestamp) ELSE DATEADD(YEAR, -1 * 1, @timestamp) END);
	select @startDate6Months = (CASE (4) WHEN 0 THEN DATEADD(DAY, -1 * 1, @timestamp) WHEN 1 THEN DATEADD(DAY, -7 * 1, @timestamp) WHEN 2 THEN DATEADD(MONTH, -1 * 1, @timestamp) WHEN 3 THEN DATEADD(MONTH, -3 * 1, @timestamp) WHEN 4 THEN DATEADD(MONTH, -6 * 1, @timestamp) ELSE DATEADD(YEAR, -1 * 1, @timestamp) END);
	select @startDate3Months = (CASE (3) WHEN 0 THEN DATEADD(DAY, -1 * 1, @timestamp) WHEN 1 THEN DATEADD(DAY, -7 * 1, @timestamp) WHEN 2 THEN DATEADD(MONTH, -1 * 1, @timestamp) WHEN 3 THEN DATEADD(MONTH, -3 * 1, @timestamp) WHEN 4 THEN DATEADD(MONTH, -6 * 1, @timestamp) ELSE DATEADD(YEAR, -1 * 1, @timestamp) END);

	with _DistinctEvents as
	(
		select
			SolutionId,
			UserId,
			EventId,
			EventType = min(EventType),
			MostRecentTimestamp = max(Timestamp)
		from
			EventInstances EI
		where
			SolutionId is not null
			and EI.Timestamp > @startDateYear
		group by
			SolutionId,
			UserId,
			EventId
	)
	insert [#distinctEventsPerSolutionPerUser]
	(
		SmallestResolution,
		SolutionId,
		UserId,
		EventId,
		EventType
	)
	select
		SmallestResolution =
		(
			case
				when MostRecentTimestamp > @startDate3Months then 3
				when MostRecentTimestamp > @startDate6Months then 4
				else 5
			end
		),
		SolutionId,
		UserId,
		EventId,
		EventType
	from
		_DistinctEvents
	where
		SolutionId between @solutionIdStart and @solutionIdEnd
	option

		(order group);

	delete from SolutionSummariesPerUser
	where
		(Resolution in (3, 4, 5))
		and (SolutionId between @solutionIdStart and @solutionIdEnd);

	insert SolutionSummariesPerUser
	(
		Resolution,
		SolutionId,
		UserId,

		HasCriticalIssues,
		HasNoncriticalIssues,

		NumSessions,
		NumSuccessfulSessions,
		NumSessionsForTrend,
		NumSuccessfulSessionsForTrend,
		OldNumSessionsForTrend,
		OldNumSuccessfulSessionsForTrend,

		IsO11User,
		IsO12User,
		IsO14User,
		IsO15User,
		IsO16User
	)
	select
		Resolution,
		SolutionId,
		UserId,

		HasCriticalIssues,
		HasNoncriticalIssues,

		NumSessions,
		NumSuccessfulSessions,
		NumSessionsForTrend,
		NumSuccessfulSessionsForTrend,
		OldNumSessionsForTrend,
		OldNumSuccessfulSessionsForTrend,

		IsO11User,
		IsO12User,
		IsO14User,
		IsO15User,
		IsO16User
	from
		[#solutionSummariesPerUser];

	delete from DistinctEventsPerSolutionPerUser
	where
		(SmallestResolution in (3, 4, 5))
		and (SolutionId between @solutionIdStart and @solutionIdEnd);

	insert DistinctEventsPerSolutionPerUser
	(
		SmallestResolution,
		SolutionId,
		UserId,
		EventId,

		EventType
	)
	select
		SmallestResolution,
		SolutionId,
		UserId,
		EventId,

		EventType
	from
		[#distinctEventsPerSolutionPerUser];
end
