if exists (select * from sys.procedures where name=N'UpdateSnapshots')
begin
	drop procedure UpdateSnapshots
end
go

create procedure UpdateSnapshots
as
begin
	declare @errorResult int;
	declare @createdTransaction bit;
	declare @createdSavepoint bit;
	declare @snapshotHourLocal int;

	set nocount on;

	select @errorResult = 0;

	select @snapshotHourLocal = isnull((select IntValue from ServerSettings where Name = 'SnapshotHourLocal'), 0);

	begin try
		if @@trancount = 0
		begin
			begin tran;
			select @createdTransaction = 1;
		end;
		else
		begin
			save tran UpdateSnapshots;
			select @createdSavepoint = 1;
		end;

		update ServerSettings
		set
			StringValue = convert(nvarchar(256), getdate(), 21)
		where
			(Name = 'LastSnapshotTimestamp')
			and (datediff(day, dateadd(hour, -@snapshotHourLocal, convert(datetime, StringValue, 21)), dateadd(hour, -@snapshotHourLocal, getdate())) > 0);

		if @@rowcount <> 0
		begin
			exec UpdateOfficeDeploymentStatusSnapshots;
			exec UpdateSolutionHealthSnapshots;

			update ServerSettings
			set
				IntValue = 0
			where
				Name = 'SolutionSummarySnapshotProgress';
		end;
	end try
	begin catch
		select @errorResult = ERROR_NUMBER();

		if @createdSavepoint = 1
		begin
			if xact_state() <> -1
			begin
				rollback tran UpdateSnapshots;
			end;
		end;
		else if @createdTransaction = 1
		begin
			rollback tran;
			select @createdTransaction = null;
		end;
	end catch

	if @createdTransaction = 1
	begin
		commit tran;
	end;

	return @errorResult;
end
go

if exists (select * from sys.procedures where name=N'UpdateIncrementalSnapshots')
begin
	drop procedure UpdateIncrementalSnapshots
end
go

create procedure UpdateIncrementalSnapshots
	@continue int output
as
begin
	declare @errorResult int;
	declare @createdTransaction bit;
	declare @createdSavepoint bit;

	set nocount on;

	select @errorResult = 0;

	select @continue = 0;

	begin try
		declare @solutionIdStart int;
		declare @solutionIdEnd int;

		if @@trancount = 0
		begin
			begin tran;
			select @createdTransaction = 1;
		end;
		else
		begin
			save tran UpdateSnapshots;
			select @createdSavepoint = 1;
		end;

		if (select IntValue from ServerSettings where Name = 'EnableUsageSnapshots') = 1
		begin
			declare @maxSolutionId int;
			select @maxSolutionId = max(SolutionId) from Solutions;

			update ServerSettings
			set

				@solutionIdStart = IntValue + 1,

				@solutionIdEnd = case when IntValue + 1000 > @maxSolutionId then @maxSolutionId else IntValue + 1000 end,

				IntValue = case when IntValue + 1000 >= @maxSolutionId then 2147483647 else IntValue + 1000 end
			where
				Name = 'SolutionSummarySnapshotProgress'
				and IntValue < @maxSolutionId;

			if @@rowcount <> 0
			begin
				exec UpdateSolutionSummariesPerUser @solutionIdStart, @solutionIdEnd;

				if @solutionIdEnd < @maxSolutionId
				begin
					select @continue = 1;
				end;
			end;
		end;
	end try
	begin catch
		select @errorResult = ERROR_NUMBER();

		if @createdSavepoint = 1
		begin
			if xact_state() <> -1
			begin
				rollback tran UpdateSnapshots;
			end;
		end;
		else if @createdTransaction = 1
		begin
			rollback tran;
			select @createdTransaction = null;
		end;
	end catch

	if @createdTransaction = 1
	begin
		commit tran;
	end;

	return @errorResult;
end
