if exists (select * from sys.procedures where name=N'FilterUsers')
begin
	drop procedure FilterUsers
end
go

create procedure FilterUsers
	@hFilterXml int,
	@returnEmptyIfNoFilterRequired bit = 0
as
begin
	declare @tags table
	(
		TagId int,
		Position int not null
	);

	declare @isFiltered bit;

	select @isFiltered = 0;

	if @hFilterXml is not null
	begin

		insert @tags ( TagId, Position )
		select
			T.TagId,
			X.Position
		from
			openxml(@hFilterXml, '/params/filters/userfilters/tags/tag', 1) with
			(
				Tag nvarchar(64) '@value',
				Position int '../@pos'
			) X
			left outer join Tags T on T.Tag = X.Tag
		where
			X.Position between 1 and 4;

		if exists (select * from @tags)
		begin
			select @isFiltered = 1;
		end;
	end;

	if (@isFiltered = 1)
	begin
		select
			U.UserId
		from
			Users U
		where
			(not exists (select * from @tags where Position = 1) or exists (select * from @tags where Position = 1 and TagId = U.Tag1Id))
			and (not exists (select * from @tags where Position = 2) or exists (select * from @tags where Position = 2 and TagId = U.Tag2Id))
			and (not exists (select * from @tags where Position = 3) or exists (select * from @tags where Position = 3 and TagId = U.Tag3Id))
			and (not exists (select * from @tags where Position = 4) or exists (select * from @tags where Position = 4 and TagId = U.Tag4Id));
	end;
	else
	begin

		if @returnEmptyIfNoFilterRequired = 1
		begin

			select UserId = 0
			where 0 = 1;
		end;
		else
		begin

			select U.UserId
			from Users U;
		end;
	end;

	return @isFiltered;
end
go

if exists (select * from sys.procedures where name=N'GetEventFiltersFromXml')
begin
	drop procedure GetEventFiltersFromXml
end
go

create procedure GetEventFiltersFromXml
	@hFilterXml int,
	@startTime smalldatetime output,
	@endTime smalldatetime output,
	@showCritical bit output,
	@showNoncritical bit output
as
begin
	declare @range int;
	declare @rangeUnits char;
	declare @timezoneOffsetInMinutes smallint;

	select
		@startTime = null,
		@endTime = null,
		@showCritical = null,
		@showNoncritical = null;

	if @hFilterXml is not null
	begin

		select
			@startTime = X.StartTime,
			@endTime = X.EndTime,
			@range = X.Range,
			@rangeUnits = X.RangeUnits,
			@showCritical = X.ShowCritical,
			@showNoncritical = X.ShowNoncritical,
			@timezoneOffsetInMinutes = X.TimezoneOffsetInMinutes
		from
			openxml(@hFilterXml, '/params', 1) with
			(
				StartTime datetime 'filters/eventfilters/daterange/@start',
				EndTime datetime 'filters/eventfilters/daterange/@end',
				Range int 'filters/eventfilters/daterange/@range',
				RangeUnits char 'filters/eventfilters/daterange/@rangeUnits',
				ShowCritical bit 'filters/eventfilters/severity/@critical',
				ShowNoncritical bit 'filters/eventfilters/severity/@noncritical',

				TimezoneOffsetInMinutes smallint 'output/@timezoneOffset'
			) X;
	end;

	if @timezoneOffsetInMinutes is null
	begin
		select @timezoneOffsetInMinutes = 0;
	end;

	if @endTime is null
	begin
		select @endTime = getutcdate();
	end;

	if @startTime is null
	begin
		declare @endTimeLocal smalldatetime;
		declare @startTimeLocal smalldatetime;

		select @endTimeLocal = dateadd(minute, @timezoneOffsetInMinutes, @endTime);

		if (@range is not null) and (@rangeUnits is not null)
		begin
			select @startTimeLocal = (CASE (@rangeUnits) WHEN 0 THEN DATEADD(DAY, -1 * @range, @endTimeLocal) WHEN 1 THEN DATEADD(DAY, -7 * @range, @endTimeLocal) WHEN 2 THEN DATEADD(MONTH, -1 * @range, @endTimeLocal) WHEN 3 THEN DATEADD(MONTH, -3 * @range, @endTimeLocal) WHEN 4 THEN DATEADD(MONTH, -6 * @range, @endTimeLocal) ELSE DATEADD(YEAR, -1 * @range, @endTimeLocal) END);
		end;
		else
		begin
			select @startTimeLocal = dateadd(month, -1, @endTimeLocal);
		end;

		select @startTime = dateadd(minute, -@timezoneOffsetInMinutes, @startTimeLocal);
	end;

	if @showCritical is null
	begin			
		select @showCritical = 1;
	end

	if @showNoncritical is null
	begin			
		select @showNoncritical = 1;
	end

	return 0;
end
