		@resolution = null;

	if @hFilterXml is not null
	begin

		select
			@timezoneOffsetInMinutes = X.TimezoneOffsetInMinutes,
			@resolution = X.Resolution
		from
			openxml(@hFilterXml, '/params/output', 1) with
			(
				TimezoneOffsetInMinutes smallint '@timezoneOffset',
				Resolution tinyint '@resolution'
			) X;
	end;

	if @timezoneOffsetInMinutes is null
	begin
		select @timezoneOffsetInMinutes = 0;
	end;

	if @resolution is null
	begin
		select @resolution = 1;
	end;

	return 0;
end
