if exists (select * from sys.procedures where name=N'GetSolutionUsageImpl')
begin
	drop procedure GetSolutionUsageImpl
end
go

create procedure GetSolutionUsageImpl
	@filterXml nvarchar(max),
	@view int
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try
		declare @solutionFilterThreshold int;
		declare @showBuiltInSolutionsOnOverview int;
		declare @useSnapshots int;
		declare @startIndex int;
		declare @numRecords int;
		declare @sortOption int;
		declare @startTime datetime;
		declare @endTime datetime;

		declare @builtInSolutions table (SolutionId int not null primary key);
		declare @snapshotResolution tinyint;
		declare @isFiltered bit;

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;

			select
				@startIndex = X.StartIndex,
				@numRecords = X.NumRecords,
				@sortOption = X.SortOption
			from
				openxml(@hFilterXml, '/params/filters', 1) with
				(
					StartIndex int 'paging/@startIndex',
					NumRecords int 'paging/@numRecords',
					SortOption int 'paging/@sortOption'
				) X;
		end

		exec GetEventFiltersFromXml @hFilterXml, @startTime output, @endTime output, null, null;

		if @startIndex is null
		begin
			select @startIndex = 1;
		end

		if @numRecords is null
		begin
			select @numRecords = 3000;
		end

		if @sortOption is null
		begin
			select @sortOption = 0;
		end

		create table [#filteredUsers]
		(
			UserId int not null primary key,
		);

		insert [#filteredUsers] ( UserId )
		exec @isFiltered = FilterUsers @hFilterXml, 1;
		if @isFiltered = 0
		begin
			drop table [#filteredUsers];
		end;

		select 
			@solutionFilterThreshold = isnull((select IntValue from ServerSettings where Name = 'SolutionFilterThreshold'), 0),
			@showBuiltInSolutionsOnOverview = isnull((select IntValue from ServerSettings where Name = 'ShowBuiltInSolutionsOnOverview'), 0),
			@useSnapshots = isnull((select IntValue from ServerSettings where Name = 'EnableUsageSnapshots'), 0);

		if @useSnapshots = 1
		begin

			select
				@snapshotResolution =
				(
					case
						when Range = 3 and RangeUnits = 2 then 3
						when Range = 1 and RangeUnits = 3 then 3

						when Range = 6 and RangeUnits = 2 then 4
						when Range = 2 and RangeUnits = 3 then 4

						when Range = 12 and RangeUnits = 2 then 5
						when Range = 4 and RangeUnits = 3 then 5
						when Range = 1 and RangeUnits = 5 then 5
						else null
					end
				)
			from
				openxml(@hFilterXml, '/params', 1) with
				(
					Range int 'filters/eventfilters/daterange/@range',
					RangeUnits char 'filters/eventfilters/daterange/@rangeUnits'
				) X;
		end;

		create table [#topSolutions]
		(
			SolutionId int not null primary key,
			ApplicationId int not null,
			RowNumber int not null,

			NumUsersOffice2003 int,
			NumComputersOffice2003 int,
			NumUsersOffice2007 int,
			NumComputersOffice2007 int,
			NumUsersOffice2010 int,
			NumComputersOffice2010 int,
			NumUsersOffice15 int,
			NumComputersOffice15 int,
			NumUsersOffice16 int,
			NumComputersOffice16 int,
			NumUsers int,
			NumComputers int,

			NumUsersOffice16Blocked int,
			NumUsersOffice16AlwaysEnabled int,

			UsersWithCriticalIssues int,
			UsersWithNoncriticalIssues int,
			DistinctCriticalIssues int,
			DistinctNoncriticalIssues int,

			AverageLoadTimeInMilliseconds int
		);

		if @snapshotResolution is not null
		begin

			if @isFiltered = 1
			begin

				if @sortOption = 0
				begin

					with _FilteredSolutions as
					(

						select
							S.SolutionId,
							S.ApplicationId
						from
							Solutions S
						where
							((@view = 0 and S.SolutionType in (0, 1)) or (@view in (1, 2) and S.SolutionType in (2, 3, 4)))
							and ((@solutionFilterThreshold = 0)
								or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

					),

					_SolutionsWithRowNumber as
					(

						select
							S.SolutionId,
							S.ApplicationId,
							RowNumber = row_number() over (order by

								(

									select count(*)
									from
										SolutionSummariesPerUser SSPU

										inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

									where
										SSPU.Resolution = @snapshotResolution
										and SSPU.SolutionId = S.SolutionId

								) desc, S.SolutionId asc

						)
						from
							_FilteredSolutions S

					)		
					insert [#topSolutions]
					(
						SolutionId,
						ApplicationId,
						RowNumber
					)
					select
						S.SolutionId,
						S.ApplicationId,
						S.RowNumber
					from
						_SolutionsWithRowNumber S
					where
						S.RowNumber >= @startIndex and S.RowNumber < @startIndex + @numRecords;

				end
				else if @sortOption = 1
				begin

					with _FilteredSolutions as
					(

						select
							S.SolutionId,
							S.ApplicationId
						from
							Solutions S
						where
							((@view = 0 and S.SolutionType in (0, 1)) or (@view in (1, 2) and S.SolutionType in (2, 3, 4)))
							and ((@solutionFilterThreshold = 0)
								or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

					),

					_SolutionsWithRowNumber as
					(

						select
							S.SolutionId,
							S.ApplicationId,
							RowNumber = row_number() over (order by

								(

									select count(*)
									from
										SolutionSummariesPerUser SSPU

										inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

									where
										SSPU.Resolution = @snapshotResolution
										and SSPU.SolutionId = S.SolutionId
										and SSPU.IsO16User = 1

								) desc, S.SolutionId asc

						)
						from
							_FilteredSolutions S

					)		
					insert [#topSolutions]
					(
						SolutionId,
						ApplicationId,
						RowNumber
					)
					select
						S.SolutionId,
						S.ApplicationId,
						S.RowNumber
					from
						_SolutionsWithRowNumber S
					where
						S.RowNumber >= @startIndex and S.RowNumber < @startIndex + @numRecords;

				end
				else if @sortOption = 2
				begin

					with _FilteredSolutions as
					(

						select
							S.SolutionId,
							S.ApplicationId
						from
							Solutions S
						where
							((@view = 0 and S.SolutionType in (0, 1)) or (@view in (1, 2) and S.SolutionType in (2, 3, 4)))
							and ((@solutionFilterThreshold = 0)
								or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

					),

					_SortKey as
					(

						select
							SSPU.SolutionId,
							Value = count(*)
						from
							SolutionSummariesPerUser SSPU

							inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

						where
							SSPU.Resolution = @snapshotResolution
							and SSPU.HasCriticalIssues = 1
						group by
							SSPU.SolutionId

					),

					_SolutionsWithRowNumber as
					(

						select
							S.SolutionId,
							S.ApplicationId,
							RowNumber = row_number() over (order by

								(case
									when (S.ApplicationId in (0, 1, 2, 4)) then SK.Value
									else null
								end) desc, S.SolutionId asc

						)
						from
							_FilteredSolutions S

							left outer join _SortKey SK on SK.SolutionId = S.SolutionId

					)		
					insert [#topSolutions]
					(
						SolutionId,
						ApplicationId,
						RowNumber
					)
					select
						S.SolutionId,
						S.ApplicationId,
						S.RowNumber
					from
						_SolutionsWithRowNumber S
					where
						S.RowNumber >= @startIndex and S.RowNumber < @startIndex + @numRecords;

				end
				else
				begin

					if @showBuiltInSolutionsOnOverview = 0
					begin
						insert @builtInSolutions
						(
							SolutionId
						)
						select
							S.SolutionId
						from
							Solutions S
						where

							exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
							or exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId);
					end;

					with _FilteredSolutions as
					(

						select
							S.SolutionId,
							S.ApplicationId
						from
							Solutions S
						where
							((@view = 0 and S.SolutionType in (0, 1)) or (@view in (1, 2) and S.SolutionType in (2, 3, 4)))
							and ((@solutionFilterThreshold = 0)
								or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

							and not exists (select * from @builtInSolutions BIS where BIS.SolutionId = S.SolutionId)

					),

					_SortKey as
					(

						select
							SSPU.SolutionId,
							Value = sum(SSPU.NumSessions)
						from
							SolutionSummariesPerUser SSPU

							inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

						where
							SSPU.Resolution = @snapshotResolution
						group by
							SSPU.SolutionId

					),

					_SolutionsWithRowNumber as
					(

						select
							S.SolutionId,
							S.ApplicationId,
							RowNumber = row_number() over (order by

								(case
									when (S.ApplicationId in (0, 1, 2, 4)) then SK.Value
									else null
								end) desc, S.SolutionId asc

						)
						from
							_FilteredSolutions S

							left outer join _SortKey SK on SK.SolutionId = S.SolutionId

					)		
					insert [#topSolutions]
					(
						SolutionId,
						ApplicationId,
						RowNumber
					)
					select
						S.SolutionId,
						S.ApplicationId,
						S.RowNumber
					from
						_SolutionsWithRowNumber S
					where
						S.RowNumber >= @startIndex and S.RowNumber < @startIndex + @numRecords;

				end

