								SIHAD.SolutionId
						)

						update [#topSolutions]
						set

							NumUsersOffice2003 = PCS.O11Users,
							NumUsersOffice2007 = PCS.O12Users,
							NumUsersOffice2010 = PCS.O14Users,
							NumUsersOffice15 = PCS.O15Users,
							NumUsersOffice16 = PCS.O16Users,
							NumUsers = PCS.TotalUsers,

							NumComputersOffice2003 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 11),
							NumComputersOffice2007 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 12),
							NumComputersOffice2010 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 14),
							NumComputersOffice15 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 15),
							NumComputersOffice16 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 16),
							NumComputers = (select count(distinct SI.ComputerId) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId),

							NumUsersOffice16Blocked =
								(
									select NumUsersBlocked
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							NumUsersOffice16AlwaysEnabled =
								(
									select NumUsersAlwaysEnabled
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							UsersWithCriticalIssues =
								(

									isnull(PCS.UsersWithCriticalIssues, 0)

								),

							UsersWithNoncriticalIssues =
								(

									isnull(PCS.UsersWithNoncriticalIssues, 0)

								),

							DistinctCriticalIssues =
								(

									isnull(DCEPS.DistinctCriticalEvents, 0)

								),

							DistinctNoncriticalIssues =
								(

									isnull(DNEPS.DistinctNoncriticalEvents, 0)

								),

							AverageLoadTimeInMilliseconds = (select avg(cast(SI.LoadTimeInMilliseconds as bigint)) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId and SI.LoadTimeInMilliseconds is not null)
						from
							[#topSolutions] TS

							left outer join _PrecalculatedSummary PCS on PCS.SolutionId = TS.SolutionId
							left outer join _DistinctCriticalEventsPerSolution DCEPS on DCEPS.SolutionId = TS.SolutionId
							left outer join _DistinctNoncriticalEventsPerSolution DNEPS on DNEPS.SolutionId = TS.SolutionId

						option

							(hash group);

					end;
					else
					begin

						with

						_PrecalculatedSummary as
						(
							select
								SSPU.SolutionId,
								UsersWithCriticalIssues = sum(cast(SSPU.HasCriticalIssues as int)),
								UsersWithNoncriticalIssues = sum(cast(SSPU.HasNoncriticalIssues as int)),

								TotalUsers = count(*),
								O11Users = sum(cast(SSPU.IsO11User as int)),
								O12Users = sum(cast(SSPU.IsO12User as int)),
								O14Users = sum(cast(SSPU.IsO14User as int)),
								O15Users = sum(cast(SSPU.IsO15User as int)),
								O16Users = sum(cast(SSPU.IsO16User as int))
							from
								SolutionSummariesPerUser SSPU

								inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

							where
								SSPU.Resolution = @snapshotResolution
							group by
								SSPU.SolutionId
						),
						_FilteredDistinctEventsPerSolutionPerUser as
						(
							select
								DESU.SolutionId,
								DESU.UserId,
								DESU.EventId,
								DESU.EventType
							from
								[#topSolutions] TS
								inner join DistinctEventsPerSolutionPerUser DESU on DESU.SolutionId = TS.SolutionId

							where

								DESU.SmallestResolution in (3, 4, 5)

						),
						_DistinctCriticalEventsPerSolution as
						(
							select
								DESU.SolutionId,
								DistinctCriticalEvents = count(distinct DESU.EventId)
							from

								[#filteredUsers] FU
								inner hash join _FilteredDistinctEventsPerSolutionPerUser DESU on DESU.UserId = FU.UserId

							where
								DESU.EventType = 1
							group by
								DESU.SolutionId
						),
						_DistinctNoncriticalEventsPerSolution as
						(
							select
								DESU.SolutionId,
								DistinctNoncriticalEvents = count(distinct DESU.EventId)
							from

								[#filteredUsers] FU
								inner hash join _FilteredDistinctEventsPerSolutionPerUser DESU on DESU.UserId = FU.UserId

							where
								DESU.EventType in (2, 3)
							group by
								DESU.SolutionId
						),

						_FilteredSolutionInstances as
						(
							select
								SI.SolutionId,
								SI.UserId,
								SI.ComputerId,
								SI.LoadTimeInMilliseconds
							from
								SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds))

								inner join [#filteredUsers] FU on FU.UserId = SI.UserId

							where
								SI.LastSeenTime > @startTime
						),

						_SolutionInstancePolicySettingsLatestVersion as
						(
							select
								SIHAD.SolutionId,
								SIHAD.UserId,
								SIHAD.ComputerId,
								SIHAD.PolicySetting,
								UOC.LastScanTime
							from
								SolutionInstanceHostAppDetails SIHAD
								inner join UsersOnComputers UOC on UOC.UserId = SIHAD.UserId and UOC.ComputerId = SIHAD.ComputerId
							where
								SIHAD.HostAppVersionMajor = 16
								and SIHAD.PolicySetting is not null
						),
						_SolutionPoliciesPerUserLatestVersion as
						(
							select
								SIPS.SolutionId,
								SIPS.UserId,
								SIPS.PolicySetting
							from
								_SolutionInstancePolicySettingsLatestVersion SIPS
								inner join _FilteredSolutionInstances FSI on FSI.SolutionId = SIPS.SolutionId and FSI.UserId = SIPS.UserId and FSI.ComputerId = SIPS.ComputerId

								inner join [#filteredUsers] FU on FU.UserId = SIPS.UserId

							where

								SIPS.ComputerId =
								(
									select top 1
										SIPS2.ComputerId
									from
										_SolutionInstancePolicySettingsLatestVersion SIPS2
									where
										SIPS2.UserId = SIPS.UserId
										and SIPS2.SolutionId = SIPS.SolutionId 
									order by
										SIPS2.LastScanTime desc
								)
						),

						_SolutionInstancesPerVersion as
						(

							select
								SIHAD.HostAppVersionMajor,
								SIHAD.SolutionId,
								NumUsers = count(distinct SIHAD.UserId),
								NumComputers = count(distinct SIHAD.ComputerId)

								,
								NumUsersBlocked =
								(
									select count(SPPU.UserId) from _SolutionPoliciesPerUserLatestVersion SPPU
									where
										SPPU.SolutionId = SIHAD.SolutionId
										and SPPU.PolicySetting in (254, 0)
								),
								NumUsersAlwaysEnabled =
								(
									select count(SPPU.UserId) from _SolutionPoliciesPerUserLatestVersion SPPU
									where
										SPPU.SolutionId = SIHAD.SolutionId
										and SPPU.PolicySetting in (1)
								)

							from
								SolutionInstanceHostAppDetails SIHAD
								inner join _FilteredSolutionInstances FSI on FSI.SolutionId = SIHAD.SolutionId and FSI.UserId = SIHAD.UserId and FSI.ComputerId = SIHAD.ComputerId
							group by
								SIHAD.HostAppVersionMajor,
								SIHAD.SolutionId
						)

						update [#topSolutions]
						set

							NumUsersOffice2003 = PCS.O11Users,
							NumUsersOffice2007 = PCS.O12Users,
							NumUsersOffice2010 = PCS.O14Users,
							NumUsersOffice15 = PCS.O15Users,
							NumUsersOffice16 = PCS.O16Users,
							NumUsers = PCS.TotalUsers,

							NumComputersOffice2003 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 11),
							NumComputersOffice2007 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 12),
							NumComputersOffice2010 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 14),
							NumComputersOffice15 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 15),
							NumComputersOffice16 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 16),
							NumComputers = (select count(distinct SI.ComputerId) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId),

							NumUsersOffice16Blocked =
								(
									select NumUsersBlocked
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							NumUsersOffice16AlwaysEnabled =
								(
									select NumUsersAlwaysEnabled
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							UsersWithCriticalIssues =
								(

									isnull(PCS.UsersWithCriticalIssues, 0)

								),

							UsersWithNoncriticalIssues =
								(

									isnull(PCS.UsersWithNoncriticalIssues, 0)

								),

							DistinctCriticalIssues =
								(

									isnull(DCEPS.DistinctCriticalEvents, 0)

								),

							DistinctNoncriticalIssues =
								(

									isnull(DNEPS.DistinctNoncriticalEvents, 0)

								),

							AverageLoadTimeInMilliseconds = (select avg(cast(SI.LoadTimeInMilliseconds as bigint)) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId and SI.LoadTimeInMilliseconds is not null)
						from
							[#topSolutions] TS

							left outer join _PrecalculatedSummary PCS on PCS.SolutionId = TS.SolutionId
							left outer join _DistinctCriticalEventsPerSolution DCEPS on DCEPS.SolutionId = TS.SolutionId
							left outer join _DistinctNoncriticalEventsPerSolution DNEPS on DNEPS.SolutionId = TS.SolutionId

						option

							(hash group);

					end;

					with

					_PrecalculatedSummary as
					(
						select
							SSPU.SolutionId,
							NumSessions = sum(SSPU.NumSessions),
							NumSuccessfulSessions = sum(SSPU.NumSuccessfulSessions),
							TotalSessionsForTrend = sum(SSPU.NumSessionsForTrend),
							SuccessfulSessionsForTrend = sum(SSPU.NumSuccessfulSessionsForTrend),
							OldTotalSessionsForTrend = sum(SSPU.OldNumSessionsForTrend),
							OldSuccessfulSessionsForTrend = sum(SSPU.OldNumSuccessfulSessionsForTrend)
						from
							SolutionSummariesPerUser SSPU

							inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

							inner join [#topSolutions] TS on TS.SolutionId = SSPU.SolutionId
						where
							SSPU.Resolution = @snapshotResolution
							and (TS.ApplicationId in (0, 1, 2, 4))
						group by
							SSPU.SolutionId
					)

					select				

						SolutionName =
							case
								when S.SolutionType = 4 then isnull(S.FileName, S.ProgId) collate Latin1_General_CI_AS_KS_WS
								else isnull(S.ProgId, S.FileName) collate Latin1_General_CI_AS_KS_WS
							end,

						NumUsers = (CASE WHEN (TS.NumUsers) = 0 THEN NULL ELSE (TS.NumUsers) END),
						NumUsersOffice2003 = (CASE WHEN (TS.NumUsersOffice2003) = 0 THEN NULL ELSE (TS.NumUsersOffice2003) END),
						NumUsersOffice2007 = (CASE WHEN (TS.NumUsersOffice2007) = 0 THEN NULL ELSE (TS.NumUsersOffice2007) END),
						NumUsersOffice2010 = (CASE WHEN (TS.NumUsersOffice2010) = 0 THEN NULL ELSE (TS.NumUsersOffice2010) END),

						NumUsersOffice16 = (CASE WHEN (TS.NumUsersOffice16) = 0 THEN NULL ELSE (TS.NumUsersOffice16) END),

						NumComputers = (CASE WHEN (TS.NumComputers) = 0 THEN NULL ELSE (TS.NumComputers) END),
						NumComputersOffice2003 = (CASE WHEN (TS.NumComputersOffice2003) = 0 THEN NULL ELSE (TS.NumComputersOffice2003) END),
						NumComputersOffice2007 = (CASE WHEN (TS.NumComputersOffice2007) = 0 THEN NULL ELSE (TS.NumComputersOffice2007) END),
						NumComputersOffice2010 = (CASE WHEN (TS.NumComputersOffice2010) = 0 THEN NULL ELSE (TS.NumComputersOffice2010) END),

						NumComputersOffice16 = (CASE WHEN (TS.NumComputersOffice16) = 0 THEN NULL ELSE (TS.NumComputersOffice16) END),

						PercentSuccessfulSessions =

							case
								when PCS.NumSessions > 0 then (cast(PCS.NumSuccessfulSessions as float) / cast(PCS.NumSessions as float))
								else null
							end,

						NumSessions =

							(CASE WHEN (PCS.NumSessions) = 0 THEN NULL ELSE (PCS.NumSessions) END),

						Trend =

							case
								when PCS.TotalSessionsForTrend > 0 and PCS.OldTotalSessionsForTrend > 0 then ((cast(PCS.SuccessfulSessionsForTrend as float) / cast(PCS.TotalSessionsForTrend as float)) - (cast(PCS.OldSuccessfulSessionsForTrend as float) / cast(PCS.OldTotalSessionsForTrend as float)))
								else null
							end,

						UsersWithCriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and PCS.NumSessions > 0 then TS.UsersWithCriticalIssues else null end,
						DistinctCriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and PCS.NumSessions > 0 then TS.DistinctCriticalIssues else null end,
						UsersWithNoncriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and PCS.NumSessions > 0 then TS.UsersWithNoncriticalIssues else null end,
						DistinctNoncriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and PCS.NumSessions > 0 then TS.DistinctNoncriticalIssues else null end,

						AverageLoadTimeInSeconds = (cast(TS.AverageLoadTimeInMilliseconds as float) / 1000.0),	
						S.ApplicationId,
						S.SolutionType,
						FileName = S.FileName,
						FileExtension =
							case
								when (S.SolutionType <> 4) and (charindex(N'.', reverse(S.FileName)) > 1) then lower(right(S.FileName, charindex(N'.', reverse(S.FileName)) - 1))
								else null
							end,
						S.Publisher,

						IsBuiltIn =
							case
								when
									exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
									or exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId) then 1
								else null
							end,

						RawBlocked =
							case
								when TS.NumUsersOffice16 > 0 then (cast(TS.NumUsersOffice16Blocked as float) / cast(TS.NumUsersOffice16 as float))
								else null
							end,
						RawAlwaysEnabled =
							case
								when TS.NumUsersOffice16 > 0 then (cast(TS.NumUsersOffice16AlwaysEnabled as float) / cast(TS.NumUsersOffice16 as float))
								else null
							end,

						S.SolutionId
					from
						[#topSolutions] TS
						inner join Solutions S on S.SolutionId = TS.SolutionId

						left outer join _PrecalculatedSummary PCS on PCS.SolutionId = TS.SolutionId

					order by
						TS.RowNumber asc;

				end;

			end;
			else
			begin

				if @sortOption = 0
				begin

					with _FilteredSolutions as
					(

						select
							S.SolutionId,
							S.ApplicationId
						from
							Solutions S
						where
							((@view = 0 and S.SolutionType in (0, 1)) or (@view in (1, 2) and S.SolutionType in (2, 3, 4)))
							and ((@solutionFilterThreshold = 0)
								or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

					),

					_SolutionsWithRowNumber as
					(

						select
							S.SolutionId,
							S.ApplicationId,
							RowNumber = row_number() over (order by

								(

									select count(*)
									from
										SolutionSummariesPerUser SSPU

									where
										SSPU.Resolution = @snapshotResolution
										and SSPU.SolutionId = S.SolutionId

								) desc, S.SolutionId asc

						)
						from
							_FilteredSolutions S

					)		
					insert [#topSolutions]
					(
						SolutionId,
						ApplicationId,
						RowNumber
					)
					select
						S.SolutionId,
						S.ApplicationId,
						S.RowNumber
					from
						_SolutionsWithRowNumber S
					where
						S.RowNumber >= @startIndex and S.RowNumber < @startIndex + @numRecords;

				end
				else if @sortOption = 1
				begin

					with _FilteredSolutions as
					(

						select
							S.SolutionId,
							S.ApplicationId
						from
							Solutions S
						where
							((@view = 0 and S.SolutionType in (0, 1)) or (@view in (1, 2) and S.SolutionType in (2, 3, 4)))
							and ((@solutionFilterThreshold = 0)
								or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

					),

					_SolutionsWithRowNumber as
					(

						select
							S.SolutionId,
							S.ApplicationId,
							RowNumber = row_number() over (order by

								(

									select count(*)
									from
										SolutionSummariesPerUser SSPU

									where
										SSPU.Resolution = @snapshotResolution
										and SSPU.SolutionId = S.SolutionId
										and SSPU.IsO16User = 1

								) desc, S.SolutionId asc

						)
						from
							_FilteredSolutions S

					)		
					insert [#topSolutions]
					(
						SolutionId,
						ApplicationId,
						RowNumber
					)
					select
						S.SolutionId,
						S.ApplicationId,
						S.RowNumber
					from
						_SolutionsWithRowNumber S
					where
