								else isnull(S.ProgId, S.FileName) collate Latin1_General_CI_AS_KS_WS
							end,

						NumUsers = (CASE WHEN (TS.NumUsers) = 0 THEN NULL ELSE (TS.NumUsers) END),
						NumUsersOffice2003 = (CASE WHEN (TS.NumUsersOffice2003) = 0 THEN NULL ELSE (TS.NumUsersOffice2003) END),
						NumUsersOffice2007 = (CASE WHEN (TS.NumUsersOffice2007) = 0 THEN NULL ELSE (TS.NumUsersOffice2007) END),
						NumUsersOffice2010 = (CASE WHEN (TS.NumUsersOffice2010) = 0 THEN NULL ELSE (TS.NumUsersOffice2010) END),

