									select count(distinct SIHAD.UserId)
									from
										SolutionInstanceHostAppDetails SIHAD
										inner join SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) on SI.SolutionId = SIHAD.SolutionId and SI.UserId = SIHAD.UserId and SI.ComputerId = SIHAD.ComputerId

									where
										SIHAD.SolutionId = S.SolutionId
										and SIHAD.HostAppVersionMajor = 16
										and SI.LastSeenTime > @startTime

								) desc, S.SolutionId asc

