						Trend =

							case
								when SS.NumSessions > 0 and OSST.NumSessions > 0 and SST.NumSessions > 0 then ((cast(SST.NumSuccessfulSessions as float) / cast(SST.NumSessions as float)) - (cast(OSST.NumSuccessfulSessions as float) / cast(OSST.NumSessions as float)))
								else null
							end,

						UsersWithCriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.UsersWithCriticalIssues else null end,
						DistinctCriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.DistinctCriticalIssues else null end,
						UsersWithNoncriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.UsersWithNoncriticalIssues else null end,
						DistinctNoncriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.DistinctNoncriticalIssues else null end,

