								EI.EventType,
								EI.EventId,
								EI.UserId
							from

								EventInstances EI

							where
								EI.Timestamp > @startTime and EI.Timestamp <= @endTime
						),

						_FilteredSolutionInstances as
						(
							select
								SI.SolutionId,
								SI.UserId,
								SI.ComputerId,
								SI.LoadTimeInMilliseconds
							from
								SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds))

							where
								SI.LastSeenTime > @startTime
						),

						_SolutionInstancePolicySettingsLatestVersion as
						(
							select
								SIHAD.SolutionId,
								SIHAD.UserId,
								SIHAD.ComputerId,
								SIHAD.PolicySetting,
								UOC.LastScanTime
							from
								SolutionInstanceHostAppDetails SIHAD
								inner join UsersOnComputers UOC on UOC.UserId = SIHAD.UserId and UOC.ComputerId = SIHAD.ComputerId
							where
								SIHAD.HostAppVersionMajor = 16
								and SIHAD.PolicySetting is not null
						),
						_SolutionPoliciesPerUserLatestVersion as
						(
							select
								SIPS.SolutionId,
								SIPS.UserId,
								SIPS.PolicySetting
							from
								_SolutionInstancePolicySettingsLatestVersion SIPS
								inner join _FilteredSolutionInstances FSI on FSI.SolutionId = SIPS.SolutionId and FSI.UserId = SIPS.UserId and FSI.ComputerId = SIPS.ComputerId

							where

								SIPS.ComputerId =
								(
									select top 1
										SIPS2.ComputerId
									from
										_SolutionInstancePolicySettingsLatestVersion SIPS2
									where
										SIPS2.UserId = SIPS.UserId
										and SIPS2.SolutionId = SIPS.SolutionId 
									order by
										SIPS2.LastScanTime desc
								)
						),

						_SolutionInstancesPerVersion as
						(

							select
								SIHAD.HostAppVersionMajor,
								SIHAD.SolutionId,
								NumUsers = count(distinct SIHAD.UserId),
								NumComputers = count(distinct SIHAD.ComputerId)

								,
								NumUsersBlocked =
								(
									select count(SPPU.UserId) from _SolutionPoliciesPerUserLatestVersion SPPU
									where
										SPPU.SolutionId = SIHAD.SolutionId
										and SPPU.PolicySetting in (254, 0)
								),
								NumUsersAlwaysEnabled =
								(
									select count(SPPU.UserId) from _SolutionPoliciesPerUserLatestVersion SPPU
									where
										SPPU.SolutionId = SIHAD.SolutionId
										and SPPU.PolicySetting in (1)
								)

							from
								SolutionInstanceHostAppDetails SIHAD
								inner join _FilteredSolutionInstances FSI on FSI.SolutionId = SIHAD.SolutionId and FSI.UserId = SIHAD.UserId and FSI.ComputerId = SIHAD.ComputerId
							group by
								SIHAD.HostAppVersionMajor,
								SIHAD.SolutionId
						)

						update [#topSolutions]
						set

							NumUsersOffice2003 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 11),
							NumUsersOffice2007 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 12),
							NumUsersOffice2010 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 14),
							NumUsersOffice15 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 15),
							NumUsersOffice16 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 16),
							NumUsers = (select count(distinct SI.UserId) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId),

							NumComputersOffice2003 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 11),
							NumComputersOffice2007 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 12),
							NumComputersOffice2010 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 14),
							NumComputersOffice15 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 15),
							NumComputersOffice16 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 16),
							NumComputers = (select count(distinct SI.ComputerId) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId),

							NumUsersOffice16Blocked =
								(
									select NumUsersBlocked
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							NumUsersOffice16AlwaysEnabled =
								(
									select NumUsersAlwaysEnabled
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							UsersWithCriticalIssues =
								(

									select count(distinct EI.UserId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType = 1

								),

							UsersWithNoncriticalIssues =
								(

									select count(distinct EI.UserId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType in (2, 3)

								),

							DistinctCriticalIssues =
								(

									select count(distinct EI.EventId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType = 1

								),

							DistinctNoncriticalIssues =
								(

									select count(distinct EI.EventId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType in (2, 3)

								),

							AverageLoadTimeInMilliseconds = (select avg(cast(SI.LoadTimeInMilliseconds as bigint)) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId and SI.LoadTimeInMilliseconds is not null)
						from
							[#topSolutions] TS

						option

							(hash group);

					end;
					else
					begin

						with

						_FilteredEventInstances as
						(

							select
								EI.SolutionId,
								EI.EventType,
								EI.EventId,
								EI.UserId
							from

								EventInstances EI

							where
								EI.Timestamp > @startTime and EI.Timestamp <= @endTime
						),

						_FilteredSolutionInstances as
						(
							select
								SI.SolutionId,
								SI.UserId,
								SI.ComputerId,
								SI.LoadTimeInMilliseconds
							from
								SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds))

							where
								SI.LastSeenTime > @startTime
						),

						_SolutionInstancePolicySettingsLatestVersion as
						(
							select
								SIHAD.SolutionId,
								SIHAD.UserId,
								SIHAD.ComputerId,
								SIHAD.PolicySetting,
								UOC.LastScanTime
							from
								SolutionInstanceHostAppDetails SIHAD
								inner join UsersOnComputers UOC on UOC.UserId = SIHAD.UserId and UOC.ComputerId = SIHAD.ComputerId
							where
								SIHAD.HostAppVersionMajor = 16
								and SIHAD.PolicySetting is not null
						),
						_SolutionPoliciesPerUserLatestVersion as
						(
							select
								SIPS.SolutionId,
								SIPS.UserId,
								SIPS.PolicySetting
							from
								_SolutionInstancePolicySettingsLatestVersion SIPS
								inner join _FilteredSolutionInstances FSI on FSI.SolutionId = SIPS.SolutionId and FSI.UserId = SIPS.UserId and FSI.ComputerId = SIPS.ComputerId

							where

								SIPS.ComputerId =
								(
									select top 1
										SIPS2.ComputerId
									from
										_SolutionInstancePolicySettingsLatestVersion SIPS2
									where
										SIPS2.UserId = SIPS.UserId
										and SIPS2.SolutionId = SIPS.SolutionId 
									order by
										SIPS2.LastScanTime desc
								)
						),

						_SolutionInstancesPerVersion as
						(

							select
								SIHAD.HostAppVersionMajor,
								SIHAD.SolutionId,
								NumUsers = count(distinct SIHAD.UserId),
								NumComputers = count(distinct SIHAD.ComputerId)

								,
								NumUsersBlocked =
								(
									select count(SPPU.UserId) from _SolutionPoliciesPerUserLatestVersion SPPU
									where
										SPPU.SolutionId = SIHAD.SolutionId
										and SPPU.PolicySetting in (254, 0)
								),
								NumUsersAlwaysEnabled =
								(
									select count(SPPU.UserId) from _SolutionPoliciesPerUserLatestVersion SPPU
									where
										SPPU.SolutionId = SIHAD.SolutionId
										and SPPU.PolicySetting in (1)
								)

							from
								SolutionInstanceHostAppDetails SIHAD
								inner join _FilteredSolutionInstances FSI on FSI.SolutionId = SIHAD.SolutionId and FSI.UserId = SIHAD.UserId and FSI.ComputerId = SIHAD.ComputerId
							group by
								SIHAD.HostAppVersionMajor,
								SIHAD.SolutionId
						)

						update [#topSolutions]
						set

							NumUsersOffice2003 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 11),
							NumUsersOffice2007 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 12),
							NumUsersOffice2010 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 14),
							NumUsersOffice15 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 15),
							NumUsersOffice16 = (select NumUsers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 16),
							NumUsers = (select count(distinct SI.UserId) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId),

							NumComputersOffice2003 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 11),
							NumComputersOffice2007 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 12),
							NumComputersOffice2010 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 14),
							NumComputersOffice15 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 15),
							NumComputersOffice16 = (select NumComputers from _SolutionInstancesPerVersion SIPV where SIPV.SolutionId = TS.SolutionId and SIPV.HostAppVersionMajor = 16),
							NumComputers = (select count(distinct SI.ComputerId) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId),

							NumUsersOffice16Blocked =
								(
									select NumUsersBlocked
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							NumUsersOffice16AlwaysEnabled =
								(
									select NumUsersAlwaysEnabled
									from _SolutionInstancesPerVersion SIPV
									where
										SIPV.SolutionId = TS.SolutionId
										and SIPV.HostAppVersionMajor = 16
								),

							UsersWithCriticalIssues =
								(

									select count(distinct EI.UserId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType = 1

								),

							UsersWithNoncriticalIssues =
								(

									select count(distinct EI.UserId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType in (2, 3)

								),

							DistinctCriticalIssues =
								(

									select count(distinct EI.EventId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType = 1

								),

							DistinctNoncriticalIssues =
								(

									select count(distinct EI.EventId)
									from
										_FilteredEventInstances EI
									where
										EI.SolutionId = TS.SolutionId
										and EI.EventType in (2, 3)

								),

							AverageLoadTimeInMilliseconds = (select avg(cast(SI.LoadTimeInMilliseconds as bigint)) from _FilteredSolutionInstances SI where SI.SolutionId = TS.SolutionId and SI.LoadTimeInMilliseconds is not null)
						from
							[#topSolutions] TS

						option

							(hash group);

					end;

					with

					_FilteredSessions as
					(
						select
							SS.SolutionId,
							SS.SessionStartTime,
							SS.State
						from

							SolutionSessions SS

							inner join [#topSolutions] TS on TS.SolutionId = SS.SolutionId
						where
							(TS.ApplicationId in (0, 1, 2, 4))
					),
					_SessionStats as
					(
						select
							SS.SolutionId,
							NumSessions = count(*),
							NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)
						from
							_FilteredSessions SS
						where
							(SS.SessionStartTime > @startTime and SS.SessionStartTime <= @endTime)
						group by
							SS.SolutionId
					),

					_SessionStatsForTrend as
					(
						select
							SS.SolutionId,
							NumSessions = count(*),
							NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)	
						from
							_FilteredSessions SS
						where
							(SS.SessionStartTime > dateadd(day, -7, @endTime) and SS.SessionStartTime <= @endTime)
						group by
							SS.SolutionId
					),
					_OldSessionStatsForTrend as
					(
						select
							SS.SolutionId,
							NumSessions = count(*),
							NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)	
						from
							_FilteredSessions SS
						where
							(SS.SessionStartTime > dateadd(day, -7, @startTime) and SS.SessionStartTime <= @startTime)
						group by
							SS.SolutionId
					)

					select				

						SolutionName =
							case
								when S.SolutionType = 4 then isnull(S.FileName, S.ProgId) collate Latin1_General_CI_AS_KS_WS
								else isnull(S.ProgId, S.FileName) collate Latin1_General_CI_AS_KS_WS
							end,

						NumUsers = (CASE WHEN (TS.NumUsers) = 0 THEN NULL ELSE (TS.NumUsers) END),
						NumUsersOffice2003 = (CASE WHEN (TS.NumUsersOffice2003) = 0 THEN NULL ELSE (TS.NumUsersOffice2003) END),
						NumUsersOffice2007 = (CASE WHEN (TS.NumUsersOffice2007) = 0 THEN NULL ELSE (TS.NumUsersOffice2007) END),
						NumUsersOffice2010 = (CASE WHEN (TS.NumUsersOffice2010) = 0 THEN NULL ELSE (TS.NumUsersOffice2010) END),

						NumUsersOffice16 = (CASE WHEN (TS.NumUsersOffice16) = 0 THEN NULL ELSE (TS.NumUsersOffice16) END),

						NumComputers = (CASE WHEN (TS.NumComputers) = 0 THEN NULL ELSE (TS.NumComputers) END),
						NumComputersOffice2003 = (CASE WHEN (TS.NumComputersOffice2003) = 0 THEN NULL ELSE (TS.NumComputersOffice2003) END),
						NumComputersOffice2007 = (CASE WHEN (TS.NumComputersOffice2007) = 0 THEN NULL ELSE (TS.NumComputersOffice2007) END),
						NumComputersOffice2010 = (CASE WHEN (TS.NumComputersOffice2010) = 0 THEN NULL ELSE (TS.NumComputersOffice2010) END),

						NumComputersOffice16 = (CASE WHEN (TS.NumComputersOffice16) = 0 THEN NULL ELSE (TS.NumComputersOffice16) END),

						PercentSuccessfulSessions =

							case
								when SS.NumSessions > 0 then (cast(SS.NumSuccessfulSessions as float) / cast(SS.NumSessions as float))
								else null
							end,

						NumSessions =

							(CASE WHEN (SS.NumSessions) = 0 THEN NULL ELSE (SS.NumSessions) END),

						Trend =

							case
								when SS.NumSessions > 0 and OSST.NumSessions > 0 and SST.NumSessions > 0 then ((cast(SST.NumSuccessfulSessions as float) / cast(SST.NumSessions as float)) - (cast(OSST.NumSuccessfulSessions as float) / cast(OSST.NumSessions as float)))
								else null
							end,

						UsersWithCriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.UsersWithCriticalIssues else null end,
						DistinctCriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.DistinctCriticalIssues else null end,
						UsersWithNoncriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.UsersWithNoncriticalIssues else null end,
						DistinctNoncriticalIssues = case when (TS.ApplicationId in (0, 1, 2, 4)) and SS.NumSessions > 0 then TS.DistinctNoncriticalIssues else null end,

						AverageLoadTimeInSeconds = (cast(TS.AverageLoadTimeInMilliseconds as float) / 1000.0),	
						S.ApplicationId,
						S.SolutionType,
						FileName = S.FileName,
						FileExtension =
							case
								when (S.SolutionType <> 4) and (charindex(N'.', reverse(S.FileName)) > 1) then lower(right(S.FileName, charindex(N'.', reverse(S.FileName)) - 1))
								else null
							end,
						S.Publisher,

						IsBuiltIn =
							case
								when
									exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
									or exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId) then 1
								else null
							end,

						RawBlocked =
							case
								when TS.NumUsersOffice16 > 0 then (cast(TS.NumUsersOffice16Blocked as float) / cast(TS.NumUsersOffice16 as float))
								else null
							end,
						RawAlwaysEnabled =
							case
								when TS.NumUsersOffice16 > 0 then (cast(TS.NumUsersOffice16AlwaysEnabled as float) / cast(TS.NumUsersOffice16 as float))
								else null
							end,

						S.SolutionId
					from
						[#topSolutions] TS
						inner join Solutions S on S.SolutionId = TS.SolutionId

						left outer join _SessionStats SS on SS.SolutionId = TS.SolutionId
						left outer join _SessionStatsForTrend SST on SST.SolutionId = TS.SolutionId
						left outer join _OldSessionStatsForTrend OSST on OSST.SolutionId = TS.SolutionId

					order by
						TS.RowNumber asc;

				end;

			end;

		end;
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult
end
go

