if exists (select * from sys.procedures where name=N'GetSolutionDetailsImpl')
begin
	drop procedure GetSolutionDetailsImpl
end
go

create procedure GetSolutionDetailsImpl
	@solutionId int,
	@filterXml nvarchar(max),
	@view int
as
begin
	declare @errorResult int;
	declare @hFilterXml int;
	declare @startTime smalldatetime;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try
		declare @timezoneOffsetInMinutes smallint;
		declare @solutionFilterThreshold int;

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;
		end

		exec GetEventFiltersFromXml @hFilterXml, @startTime output, null, null, null;
		exec GetOutputParametersFromXml @hFilterXml, @timezoneOffsetInMinutes output, null;

		create table [#filteredUsers]
		(
			UserId int not null primary key
		);

		insert [#filteredUsers] ( UserId )
		exec FilterUsers @hFilterXml;

		select @solutionFilterThreshold = isnull((select IntValue from ServerSettings where Name = 'SolutionFilterThreshold'), 0);
		if (select count(*) from SolutionInstances SI where SI.SolutionId = @solutionId) < @solutionFilterThreshold
		begin
			select @errorResult = 1;
		end
		else
		begin

			if @view = 0
			begin
				select
					U.UserName,
					U.UserDomain,
					C.ComputerName,
					C.ComputerDomain,
					FullPath = (CASE WHEN ((CASE WHEN S.MaskedFileName IS NULL THEN SI.FullPath ELSE REPLACE(SI.FullPath, N'*', N'********') END)) = N'' THEN NULL ELSE ((CASE WHEN S.MaskedFileName IS NULL THEN SI.FullPath ELSE REPLACE(SI.FullPath, N'*', N'********') END)) END),
					FileSizeInKB = (((SI.FileSizeInBytes) + 1023) / 1024),
					Author = (CASE WHEN (SI.Author) = N'' THEN NULL ELSE (SI.Author) END),
					HasVba = (CASE WHEN (SI.HasVba) = 0 THEN NULL ELSE (SI.HasVba) END),
					HasOle = (CASE WHEN (SI.HasOle) = 0 THEN NULL ELSE (SI.HasOle) END),
					HasExternalDataConnections = (CASE WHEN (SI.HasExternalDataConnections) = 0 THEN NULL ELSE (SI.HasExternalDataConnections) END),
					HasActiveXControl = (CASE WHEN (SI.HasActiveXControl) = 0 THEN NULL ELSE (SI.HasActiveXControl) END),
					HasAssemblyReference = (CASE WHEN (SI.HasAssemblyReference) = 0 THEN NULL ELSE (SI.HasAssemblyReference) END),
					LastLoadedTime = dateadd(minute, @timezoneOffsetInMinutes, SI.LastLoadedTime),
					Title = (CASE WHEN ((CASE WHEN S.MaskedFileName IS NULL THEN SI.Title ELSE REPLACE(SI.Title, N'*', N'********') END)) = N'' THEN NULL ELSE ((CASE WHEN S.MaskedFileName IS NULL THEN SI.Title ELSE REPLACE(SI.Title, N'*', N'********') END)) END),
					SIHAD.HostAppVersionMajor
				from
					SolutionInstances SI
					inner join Solutions S on S.SolutionId = SI.SolutionId
					inner join Users U on U.UserId = SI.UserId
					inner join Computers C on C.ComputerId = SI.ComputerId
					inner join [#filteredUsers] FU on FU.UserId = U.UserId
					left outer join SolutionInstanceHostAppDetails SIHAD on SIHAD.SolutionId = SI.SolutionId and SIHAD.UserId = SI.UserId and SIHAD.ComputerId = SI.ComputerId
				where
					SI.SolutionId = @solutionId
					and SI.LastSeenTime > @startTime;
			end
			else
			begin
				select
					U.UserName,
					U.UserDomain,
					C.ComputerName,
					C.ComputerDomain,
					Version = ((CAST((CAST(SI.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(SI.VersionRevision as int) + 65536) % 65536 as nvarchar)),
					LoadTimeInSeconds = case when SIHAD.HostAppVersionMajor >= 15 then (cast(SI.LoadTimeInMilliseconds as float) / 1000.0) else null end,
					LastLoadedTime = dateadd(minute, @timezoneOffsetInMinutes, SI.LastLoadedTime),
					SI.LoadBehavior,
					Publisher = (CASE WHEN (S.Publisher) = N'' THEN NULL ELSE (S.Publisher) END),
					Author = (CASE WHEN (SI.Author) = N'' THEN NULL ELSE (SI.Author) END),
					FriendlyName = (CASE WHEN (SI.FriendlyName) = N'' THEN NULL ELSE (SI.FriendlyName) END),
					Description = (CASE WHEN (SI.Description) = N'' THEN NULL ELSE (SI.Description) END),
					FileSizeInKB = (((SI.FileSizeInBytes) + 1023) / 1024),
					FullPath = (CASE WHEN (SI.FullPath) = N'' THEN NULL ELSE (SI.FullPath) END),

					SI.CpuArchitecture,
					SIHAD.PolicySetting,
					SIHAD.HostAppVersionMajor
				from
					SolutionInstances SI
					inner join Solutions S on S.SolutionId = SI.SolutionId
					inner join Users U on U.UserId = SI.UserId
					inner join Computers C on C.ComputerId = SI.ComputerId
					inner join [#filteredUsers] FU on FU.UserId = U.UserId
					left outer join SolutionInstanceHostAppDetails SIHAD on SIHAD.SolutionId = SI.SolutionId and SIHAD.UserId = SI.UserId and SIHAD.ComputerId = SI.ComputerId
				where
					SI.SolutionId = @solutionId
					and SI.LastSeenTime > @startTime;
			end
		end
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
