create procedure GetSolutionIssuesImpl
	@solutionId int,
	@eventId int,
	@filterXml nvarchar(max),
	@view int
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try
		declare @solutionFilterThreshold int;
		declare @startTime smalldatetime;
		declare @endTime smalldatetime;
		declare @showCritical bit;
		declare @showNoncritical bit;
		declare @timezoneOffsetInMinutes smallint;

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;
		end

		exec GetEventFiltersFromXml @hFilterXml, @startTime output, @endTime output, @showCritical output, @showNoncritical output;
		exec GetOutputParametersFromXml @hFilterXml, @timezoneOffsetInMinutes output, null;

		create table [#filteredUsers]
		(
			UserId int not null primary key
		);

		insert [#filteredUsers] ( UserId )
		exec FilterUsers @hFilterXml;

		select @solutionFilterThreshold = isnull((select IntValue from ServerSettings where Name = 'SolutionFilterThreshold'), 0);
		if (select count(*) from SolutionInstances SI where SI.SolutionId = @solutionId) < @solutionFilterThreshold
		begin
			select @errorResult = 1;
		end
		else
		begin

			if @view = 0
			begin
				with _FilteredEventInstances as
				(
					select
						EventInstanceId,
						UserId,
						ComputerId,
						SolutionId,
						Timestamp,
						EventId,
						EventType,
						HostAppVersionMajor,
						HostAppVersionMinor,
						HostAppVersionBuild,
						HostAppVersionRevision
					from
						EventInstances
					where
						(Timestamp > @startTime and Timestamp <= @endTime)
						and (((@showCritical = 1) and (EventType = 1))
							or ((@showNoncritical = 1) and (EventType in (2, 3))))
				)
				select
					EI.EventId,
					Timestamp = dateadd(minute, @timezoneOffsetInMinutes, EI.Timestamp),
					U.UserName,
					U.UserDomain,
					C.ComputerName,
					C.ComputerDomain,
					FullPath = (CASE WHEN (SI.FullPath) = N'' THEN NULL ELSE (SI.FullPath) END),
					OfficeVersion = ((CAST((CAST(EI.HostAppVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(EI.HostAppVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(EI.HostAppVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(EI.HostAppVersionRevision as int) + 65536) % 65536 as nvarchar)),
					EILSC.LoadedSolutions,
					FileSizeInKB = (((SI.FileSizeInBytes) + 1023) / 1024),
					Author = (CASE WHEN (SI.Author) = N'' THEN NULL ELSE (SI.Author) END),
					HasVba = (CASE WHEN (SI.HasVba) = 0 THEN NULL ELSE (SI.HasVba) END),
					HasOle = (CASE WHEN (SI.HasOle) = 0 THEN NULL ELSE (SI.HasOle) END),
					HasExternalDataConnections = (CASE WHEN (SI.HasExternalDataConnections) = 0 THEN NULL ELSE (SI.HasExternalDataConnections) END),
					HasActiveXControl = (CASE WHEN (SI.HasActiveXControl) = 0 THEN NULL ELSE (SI.HasActiveXControl) END),
					HasAssemblyReference = (CASE WHEN (SI.HasAssemblyReference) = 0 THEN NULL ELSE (SI.HasAssemblyReference) END),
					Title = (CASE WHEN (SI.Title) = N'' THEN NULL ELSE (SI.Title) END)
				from
					_FilteredEventInstances EI
					inner join Users U on U.UserId = EI.UserId
					inner join Computers C on C.ComputerId = EI.ComputerId
					inner join SolutionInstances SI on SI.SolutionId = EI.SolutionId and SI.UserId = EI.UserId and SI.ComputerId = EI.ComputerId
					inner join Solutions S on S.SolutionId = EI.SolutionId
					inner join [#filteredUsers] FU on FU.UserId = EI.UserId
					left outer join VEventInstancesLoadedSolutionsConcatenated EILSC on EILSC.EventInstanceId = EI.EventInstanceId
				where
					EI.SolutionId = @solutionId
					and EI.EventType in (1, 2, 3)
					and ((@eventId is null) or (EI.EventId = @eventId))
				order by
					EI.Timestamp desc;
			end
			else
			begin
				with _FilteredEventInstances as
				(
					select
						EventInstanceId,
						UserId,
						ComputerId,
						SolutionId,
						Timestamp,
						EventId,
						EventType,
						HostAppVersionMajor,
						HostAppVersionMinor,
						HostAppVersionBuild,
						HostAppVersionRevision
					from
						EventInstances
					where
						Timestamp > @startTime and Timestamp <= @endTime
				)
				select
					EI.EventId,
					Timestamp = dateadd(minute, @timezoneOffsetInMinutes, EI.Timestamp),
					U.UserName,
					U.UserDomain,
					C.ComputerName,
					C.ComputerDomain,
					Version = ((CAST((CAST(SI.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(SI.VersionRevision as int) + 65536) % 65536 as nvarchar)),
					SI.CpuArchitecture,
					OfficeVersion = ((CAST((CAST(EI.HostAppVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(EI.HostAppVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(EI.HostAppVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(EI.HostAppVersionRevision as int) + 65536) % 65536 as nvarchar)),
					LoadTimeInSeconds = (cast(SI.LoadTimeInMilliseconds as float) / 1000.0),
					SI.LoadBehavior,
					SIHAD_Latest.PolicySetting,
					EILSC.LoadedSolutions,
					Publisher = (CASE WHEN (S.Publisher) = N'' THEN NULL ELSE (S.Publisher) END),
					Author = (CASE WHEN (SI.Author) = N'' THEN NULL ELSE (SI.Author) END),
					FriendlyName = (CASE WHEN (SI.FriendlyName) = N'' THEN NULL ELSE (SI.FriendlyName) END),
					Description = (CASE WHEN (SI.Description) = N'' THEN NULL ELSE (SI.Description) END),
					FileSizeInKB = (((SI.FileSizeInBytes) + 1023) / 1024),
					FullPath = (CASE WHEN (SI.FullPath) = N'' THEN NULL ELSE (SI.FullPath) END)
				from
					_FilteredEventInstances EI
					inner join Users U on U.UserId = EI.UserId
					inner join Computers C on C.ComputerId = EI.ComputerId
					inner join SolutionInstances SI on SI.SolutionId = EI.SolutionId and SI.UserId = EI.UserId and SI.ComputerId = EI.ComputerId
					inner join Solutions S on S.SolutionId = EI.SolutionId
					inner join [#filteredUsers] FU on FU.UserId = EI.UserId
					left outer join VEventInstancesLoadedSolutionsConcatenated EILSC on EILSC.EventInstanceId = EI.EventInstanceId
					left outer join SolutionInstanceHostAppDetails SIHAD_Latest on SIHAD_Latest.SolutionId = EI.SolutionId and SIHAD_Latest.UserId = EI.UserId and SIHAD_Latest.ComputerId = EI.ComputerId and SIHAD_Latest.HostAppVersionMajor = 16 and SIHAD_Latest.PolicySetting is not null
				where
					EI.SolutionId = @solutionId
					and EI.EventType in (1, 2, 3)
					and ((@eventId is null) or (EI.EventId = @eventId))
				order by
					EI.Timestamp desc;
			end
		end
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
