begin
	drop procedure GetDataProcessorStatus
end
go

create procedure GetDataProcessorStatus
	@interfaceVersion int,
	@filterXml nvarchar(max),
	@getUserAndComputerCounts bit = 1	
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try
		declare @timezoneOffsetInMinutes smallint;
		declare @isFiltered bit;

		declare @results table (
			DataProcessorName nvarchar(15) collate Latin1_General_CI_AS_KS_WS not null primary key,
			HealthStatus int,
			NumUsers int,
			NumComputers int,
			LastUpdated smalldatetime
		);

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;
		end

		exec GetOutputParametersFromXml @hFilterXml, @timezoneOffsetInMinutes output, null;

		create table [#filteredUsers]
		(
			UserId int not null primary key
		);

		insert [#filteredUsers] ( UserId )
		exec @isFiltered = FilterUsers @hFilterXml, 1;
		if @isFiltered = 0
		begin
			drop table [#filteredUsers];
		end;

		if @isFiltered = 1
		begin

			insert @results
			(
				DataProcessorName,
				HealthStatus,
				LastUpdated
			)
			select
				UOC.DataProcessorName,
				HealthStatus =
					case
						when max(UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) then null
						when max(UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) then -1
						when (CAST(sum(case when (CASE WHEN (UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) THEN NULL WHEN (UOC.LastUpdatedTime) < dateadd(day, -14, getutcdate()) THEN -1 WHEN (UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) THEN 0 ELSE 1 END) = -1 then 1 else 0 end) AS FLOAT) / CAST(sum(case when (CASE WHEN (UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) THEN NULL WHEN (UOC.LastUpdatedTime) < dateadd(day, -14, getutcdate()) THEN -1 WHEN (UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) THEN 0 ELSE 1 END) is not null then 1 else 0 end) AS FLOAT) * 100.0) >= 5.0 then 0
						else 1
					end,

				LastUpdated = dateadd(minute, @timezoneOffsetInMinutes, max(UOC.LastUpdatedTime))
			from
				UsersOnComputers UOC
				inner join Computers C on C.ComputerId = UOC.ComputerId

				inner join [#filteredUsers] FU on FU.UserId = UOC.UserId

			where
				UOC.LastUpdatedTime >= dateadd(day, -90, getutcdate())
			group by
				UOC.DataProcessorName;

			if (@getUserAndComputerCounts = 1)
			begin
				with _DataProcessorStats as
				(
					select 
						DataProcessorName = UOC.DataProcessorName,
						NumUsers = count(distinct UOC.UserId),
						NumComputers = count(distinct UOC.ComputerId)
					from
						UsersOnComputers UOC

						inner join [#filteredUsers] FU on FU.UserId = UOC.UserId

					where
						UOC.LastUpdatedTime >= dateadd(day, -90, getutcdate())
					group by
						UOC.DataProcessorName
				)
				update @results
				set
					NumUsers = DPS.NumUsers,
					NumComputers = DPS.NumComputers
				from
					@results X
					inner join _DataProcessorStats DPS on DPS.DataProcessorName = X.DataProcessorName;
			end;

			select * from @results;

		end;
		else
		begin

			insert @results
			(
				DataProcessorName,
				HealthStatus,
				LastUpdated
			)
			select
				UOC.DataProcessorName,
				HealthStatus =
					case
						when max(UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) then null
						when max(UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) then -1
						when (CAST(sum(case when (CASE WHEN (UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) THEN NULL WHEN (UOC.LastUpdatedTime) < dateadd(day, -14, getutcdate()) THEN -1 WHEN (UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) THEN 0 ELSE 1 END) = -1 then 1 else 0 end) AS FLOAT) / CAST(sum(case when (CASE WHEN (UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) THEN NULL WHEN (UOC.LastUpdatedTime) < dateadd(day, -14, getutcdate()) THEN -1 WHEN (UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) THEN 0 ELSE 1 END) is not null then 1 else 0 end) AS FLOAT) * 100.0) >= 5.0 then 0
						else 1
					end,

				LastUpdated = dateadd(minute, @timezoneOffsetInMinutes, max(UOC.LastUpdatedTime))
			from
				UsersOnComputers UOC
				inner join Computers C on C.ComputerId = UOC.ComputerId

			where
				UOC.LastUpdatedTime >= dateadd(day, -90, getutcdate())
			group by
				UOC.DataProcessorName;

			if (@getUserAndComputerCounts = 1)
			begin
				with _DataProcessorStats as
				(
					select 
						DataProcessorName = UOC.DataProcessorName,
						NumUsers = count(distinct UOC.UserId),
						NumComputers = count(distinct UOC.ComputerId)
					from
						UsersOnComputers UOC

					where
						UOC.LastUpdatedTime >= dateadd(day, -90, getutcdate())
					group by
						UOC.DataProcessorName
				)
				update @results
				set
					NumUsers = DPS.NumUsers,
					NumComputers = DPS.NumComputers
				from
					@results X
					inner join _DataProcessorStats DPS on DPS.DataProcessorName = X.DataProcessorName;
			end;

			select * from @results;

		end;
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
go

