create procedure GetUsersAndComputers
	@interfaceVersion int,
	@dataProcessorName nvarchar(15),
	@filterXml nvarchar(max)
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try
		declare @timezoneOffsetInMinutes smallint;

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;
		end

		exec GetOutputParametersFromXml @hFilterXml, @timezoneOffsetInMinutes output, null;

		create table [#filteredUsers]
		(
			UserId int not null primary key
		);

		insert [#filteredUsers] ( UserId )
		exec FilterUsers @hFilterXml;

		if @interfaceVersion <= 11
		begin
			select
				U.UserName,
				HealthStatus = (CASE WHEN (UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) THEN NULL WHEN (UOC.LastUpdatedTime) < dateadd(day, -14, getutcdate()) THEN -1 WHEN (UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) THEN 0 ELSE 1 END),
				C.ComputerName,
				LastUpdatedTime = dateadd(minute, @timezoneOffsetInMinutes, UOC.LastUpdatedTime),
				Tag1 = T1.Tag,
				Tag2 = T2.Tag,
				Tag3 = T3.Tag,
				Tag4 = T4.Tag,
				AgentVersion = ((CAST((CAST(C.AgentVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.AgentVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.AgentVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(C.AgentVersionRevision as int) + 65536) % 65536 as nvarchar))
			from
				Users U
				inner join [#filteredUsers] FU on FU.UserId = U.UserId
				inner join UsersOnComputers UOC on UOC.UserId = U.UserId
				inner join Computers C on C.ComputerId = UOC.ComputerId
				left outer join Tags T1 on T1.TagId = U.Tag1Id
				left outer join Tags T2 on T2.TagId = U.Tag2Id
				left outer join Tags T3 on T3.TagId = U.Tag3Id
				left outer join Tags T4 on T4.TagId = U.Tag4Id
			where
				(UOC.LastUpdatedTime >= dateadd(day, -90, getutcdate()))
				and ((@dataProcessorName is null) or (UOC.DataProcessorName = @dataProcessorName));
		end;
		else
		begin
			with _LatestOfficeVersions as
			(
				select * from
					(
						select
							SI.UserId,
							SI.ComputerId,
							SI.VersionMajor,
							SI.VersionMinor,
							SI.VersionBuild,
							SI.VersionRevision,
							RowNumber = row_number() over (partition by SI.UserId, SI.ComputerId order by SI.VersionMajor desc, SI.LastSeenTime desc)
						from
							Solutions S
							inner join SolutionInstances SI on SI.SolutionId = S.SolutionId
							inner join UsersOnComputers UOC on UOC.UserId = SI.UserId and UOC.ComputerId = SI.ComputerId
						where
							S.SolutionType = 6
							and SI.LastSeenTime >= UOC.LastScanTime
					) X
				where
					X.RowNumber = 1
			)
			select
				U.UserName,
				HealthStatus = (CASE WHEN (UOC.LastUpdatedTime) < dateadd(day, -30, getutcdate()) THEN NULL WHEN (UOC.LastUpdatedTime) < dateadd(day, -14, getutcdate()) THEN -1 WHEN (UOC.LastUpdatedTime) < dateadd(day, -1, getutcdate()) THEN 0 ELSE 1 END),
				C.ComputerName,
				LastUpdatedTime = dateadd(minute, @timezoneOffsetInMinutes, UOC.LastUpdatedTime),
				Tag1 = T1.Tag,
				Tag2 = T2.Tag,
				Tag3 = T3.Tag,
				Tag4 = T4.Tag,
				AgentVersion = ((CAST((CAST(C.AgentVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.AgentVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.AgentVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(C.AgentVersionRevision as int) + 65536) % 65536 as nvarchar)),
				LatestOfficeVersion = ((CAST((CAST(LOV.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(LOV.VersionRevision as int) + 65536) % 65536 as nvarchar))
			from
				Users U
				inner join [#filteredUsers] FU on FU.UserId = U.UserId
				inner join UsersOnComputers UOC on UOC.UserId = U.UserId
				inner join Computers C on C.ComputerId = UOC.ComputerId
				left outer join Tags T1 on T1.TagId = U.Tag1Id
				left outer join Tags T2 on T2.TagId = U.Tag2Id
				left outer join Tags T3 on T3.TagId = U.Tag3Id
				left outer join Tags T4 on T4.TagId = U.Tag4Id
				left outer hash join _LatestOfficeVersions LOV on LOV.UserId = U.UserId and LOV.ComputerId = UOC.ComputerId
			where
				(UOC.LastUpdatedTime >= dateadd(day, -90, getutcdate()))
				and ((@dataProcessorName is null) or (UOC.DataProcessorName = @dataProcessorName));
		end;
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
