if exists (select * from sys.procedures where name=N'GetOfficeInstallationStatus')
begin
	drop procedure GetOfficeInstallationStatus
end
go

create procedure GetOfficeInstallationStatus
	@interfaceVersion int,
	@filterXml nvarchar(max)
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;
		end

		create table [#filteredUsers]
		(
			UserId int not null primary key
		);

		insert [#filteredUsers] ( UserId )
		exec FilterUsers @hFilterXml;

		with _OfficeUsers as
		(
			select distinct
				SI.VersionMajor,
				SI.CpuArchitecture,
				SI.UserId
			from
				Solutions S
				inner join SolutionInstances SI on SI.SolutionId = S.SolutionId
				inner join [#filteredUsers] FU on FU.UserId = SI.UserId
				inner join UsersOnComputers UOC on UOC.UserId = SI.UserId and UOC.ComputerId = SI.ComputerId
			where
				S.SolutionType = 6

				and SI.LastSeenTime >= UOC.LastScanTime
				and SI.LastSeenTime >= dateadd(day, -90, getutcdate())
		),
		_OfficeVersions as
		(
			select VersionMajor = 11
			union
			select VersionMajor = 12
			union
			select VersionMajor = 14
			union
			select VersionMajor = 15
			union
			select VersionMajor = 16
		)
		select
			OV.VersionMajor,
			NumUsersX86 = sum(case when OU.CpuArchitecture = 0 then 1 else 0 end),
			NumUsersX64 = sum(case when OU.CpuArchitecture = 9 then 1 else 0 end),
			NumUsersARM =
				case
					when OV.VersionMajor >= 15 then sum(case when OU.CpuArchitecture = 5 then 1 else 0 end)
					else null
				end
		from
			_OfficeVersions OV
			left outer join _OfficeUsers OU on OU.VersionMajor = OV.VersionMajor
		group by
			OV.VersionMajor
		order by
			OV.VersionMajor desc;
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
