if exists (select * from sys.procedures where name=N'GetTags')
begin
	drop procedure GetTags
end
go

create procedure GetTags
	@interfaceVersion int,
	@position int
as
begin
	declare @errorResult int;

	set nocount on;

	select @errorResult = 0;

	if @position not between 1 and 4
	begin
		select @errorResult = 1;
	end
	else
	begin
		select
			T.Tag
		from
			Tags T
		where
			exists (
				select * from Users U where
				(
					case
						when @position = 1 then U.Tag1Id
						when @position = 2 then U.Tag2Id
						when @position = 3 then U.Tag3Id
						else U.Tag4Id
					end
				) = T.TagId)
		order by
			T.Tag asc;
	end

	return @errorResult;
end
