if exists (select * from sys.procedures where name=N'GetOfficeDeploymentSummary')
begin
	drop procedure GetOfficeDeploymentSummary
end
go

create procedure GetOfficeDeploymentSummary
	@interfaceVersion int,
	@filterXml nvarchar(max)
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try		
		declare @tags table
		(
			TagId int not null primary key,
			Position int not null
		);
		declare @startTime smalldatetime;
		declare @endTime smalldatetime;
		declare @resolution tinyint;
		declare @timezoneOffsetInMinutes smallint;

		declare @startTimeLocal smalldatetime;
		declare @endTimeLocal smalldatetime;
		declare @i int;

		declare @dataPointTimestamps table
		(
			TimestampLocal smalldatetime not null primary key
		);

		declare @results table
		(
			TimestampLocal smalldatetime not null primary key,
			NumUsersOffice2003 int,
			NumUsersOffice2007 int,
			NumUsersOffice2011 int,
			NumUsersOffice15 int,
			NumUsersOffice16 int
		);

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;

			insert @tags ( TagId, Position )
			select
				T.TagId,
				X.Position
			from
				Tags T
				inner join openxml(@hFilterXml, '/params/filters/userfilters/tags/tag', 1) with
				(
					Tag nvarchar(32) '@value',
					Position int '../@pos'
				) X on X.Tag = T.Tag;
		end

		exec GetEventFiltersFromXml @hFilterXml, @startTime output, @endTime output, null, null;
		exec GetOutputParametersFromXml @hFilterXml, @timezoneOffsetInMinutes output, @resolution output;

		create table [#filteredUsers]
		(
			UserId int not null primary key,
		);

		insert [#filteredUsers] ( UserId )
		exec FilterUsers @hFilterXml;

		select
			@startTimeLocal = (DATEADD(DAY, DATEDIFF(DAY, 0, dateadd(minute, @timezoneOffsetInMinutes, @startTime)), 0)),
			@endTimeLocal = dateadd(minute, @timezoneOffsetInMinutes, @endTime);

		select @i = 1;

		while (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 1 THEN DATEADD(DAY, -7 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 2 THEN DATEADD(MONTH, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 3 THEN DATEADD(MONTH, -3 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 4 THEN DATEADD(MONTH, -6 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) ELSE DATEADD(YEAR, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) END) >= @startTimeLocal
		begin
			insert @dataPointTimestamps ( TimestampLocal ) values ( (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 1 THEN DATEADD(DAY, -7 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 2 THEN DATEADD(MONTH, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 3 THEN DATEADD(MONTH, -3 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 4 THEN DATEADD(MONTH, -6 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) ELSE DATEADD(YEAR, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) END) );

			select @i = @i + 1;
		end;

		with _FilteredOfficeDeploymentStatusSnapshots as
		(
			select
				TimestampLocal = dateadd(minute, @timezoneOffsetInMinutes, ODSS.Timestamp),
				ODSS.Tag1Id,
				ODSS.Tag2Id,
				ODSS.Tag3Id,
				ODSS.Tag4Id,
				ODSS.VersionMajor,
				ODSS.NumUsers
			from
				OfficeDeploymentStatusSnapshots ODSS
			where
				(not exists (select * from @tags where Position = 1) or exists (select * from @tags where Position = 1 and TagId = ODSS.Tag1Id))
				and (not exists (select * from @tags where Position = 2) or exists (select * from @tags where Position = 2 and TagId = ODSS.Tag2Id))
				and (not exists (select * from @tags where Position = 3) or exists (select * from @tags where Position = 3 and TagId = ODSS.Tag3Id))
				and (not exists (select * from @tags where Position = 4) or exists (select * from @tags where Position = 4 and TagId = ODSS.Tag4Id))
				and (dateadd(minute, @timezoneOffsetInMinutes, ODSS.Timestamp) > @startTimeLocal)
				and (dateadd(minute, @timezoneOffsetInMinutes, ODSS.Timestamp) <= @endTimeLocal)
		),
		_LastSnapshotTimestampPerDay as
		(

			select
				TimestampLocal = max(FODSS.TimestampLocal)
			from
				_FilteredOfficeDeploymentStatusSnapshots FODSS
			group by
				(DATEADD(DAY, DATEDIFF(DAY, 0, FODSS.TimestampLocal), 0))
		)
		insert @results
		(
			TimestampLocal,
			NumUsersOffice2003,
			NumUsersOffice2007,
			NumUsersOffice2011,
			NumUsersOffice15,
			NumUsersOffice16
		)
		select
			TimestampLocal = FODSS.TimestampLocal,
			NumUsersOffice2003 = sum(case when FODSS.VersionMajor = 11 then FODSS.NumUsers else 0 end),
			NumUsersOffice2007 = sum(case when FODSS.VersionMajor = 12 then FODSS.NumUsers else 0 end),
			NumUsersOffice2011 = sum(case when FODSS.VersionMajor = 14 then FODSS.NumUsers else 0 end),
			NumUsersOffice15 = sum(case when FODSS.VersionMajor = 15 then FODSS.NumUsers else 0 end),
			NumUsersOffice16 = sum(case when FODSS.VersionMajor = 16 then FODSS.NumUsers else 0 end)
		from
			@dataPointTimestamps DPT
			inner join _LastSnapshotTimestampPerDay LSTPD on (DATEADD(DAY, DATEDIFF(DAY, 0, LSTPD.TimestampLocal), 0)) = (DATEADD(DAY, DATEDIFF(DAY, 0, DPT.TimestampLocal), 0))
			inner join _FilteredOfficeDeploymentStatusSnapshots FODSS on FODSS.TimestampLocal = LSTPD.TimestampLocal
		group by
			FODSS.TimestampLocal;

		insert @results
		(
			TimestampLocal,
			NumUsersOffice2003,
			NumUsersOffice2007,
			NumUsersOffice2011,
			NumUsersOffice15,
			NumUsersOffice16
		)
		select
			TimestampLocal = DPT.TimestampLocal,
			NumUsersOffice2003 = 0,
			NumUsersOffice2007 = 0,
			NumUsersOffice2011 = 0,
			NumUsersOffice15 = 0,
			NumUsersOffice16 = 0
		from
			@dataPointTimestamps DPT
		where
			not exists (select * from @results R where (DATEADD(DAY, DATEDIFF(DAY, 0, R.TimestampLocal), 0)) = (DATEADD(DAY, DATEDIFF(DAY, 0, DPT.TimestampLocal), 0)));

		with _OfficeUsersPerVersion as
		(
			select
				SI.VersionMajor,
				NumUsers = count(distinct SI.UserId)
			from
				SolutionInstances SI
				inner join [#filteredUsers] FU on FU.UserId = SI.UserId
				inner join Solutions S  on S.SolutionId = SI.SolutionId
				inner join UsersOnComputers UOC on UOC.UserId = SI.UserId and UOC.ComputerId = SI.ComputerId
			where
				S.SolutionType = 6

				and SI.LastSeenTime >= UOC.LastScanTime
				and SI.LastSeenTime >= dateadd(day, -90, getutcdate())
			group by
				SI.VersionMajor
		)
		insert @results
		(
			TimestampLocal,
			NumUsersOffice2003,
			NumUsersOffice2007,
			NumUsersOffice2011,
			NumUsersOffice15,
			NumUsersOffice16
		)
		select
			TimestampLocal = dateadd(minute, @timezoneOffsetInMinutes, getutcdate()),
			NumUsersOffice2003 = max(case when OUPV.VersionMajor = 11 then OUPV.NumUsers else 0 end),
			NumUsersOffice2007 = max(case when OUPV.VersionMajor = 12 then OUPV.NumUsers else 0 end),
			NumUsersOffice2011 = max(case when OUPV.VersionMajor = 14 then OUPV.NumUsers else 0 end),
			NumUsersOffice15 = max(case when OUPV.VersionMajor = 15 then OUPV.NumUsers else 0 end),
			NumUsersOffice16 = max(case when OUPV.VersionMajor = 16 then OUPV.NumUsers else 0 end)
		from
			_OfficeUsersPerVersion OUPV;

		select
			R.TimestampLocal,
			NumUsersOffice2003 = isnull(R.NumUsersOffice2003, 0),
			NumUsersOffice2007 = isnull(R.NumUsersOffice2007, 0),
			NumUsersOffice2011 = isnull(R.NumUsersOffice2011, 0),
			NumUsersOffice15 = isnull(R.NumUsersOffice15, 0),
			NumUsersOffice16 = isnull(R.NumUsersOffice16, 0)
		from
			@results R
		order by
			R.TimestampLocal asc;
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
go

if exists (select * from sys.procedures where name=N'GetSolutionHealthSummaryImpl')
begin
	drop procedure GetSolutionHealthSummaryImpl
end
go

create procedure GetSolutionHealthSummaryImpl
	@successRateGoal float,
	@filterXml nvarchar(max),
	@view int
as
begin
	declare @errorResult int;
	declare @hFilterXml int;

	set nocount on;

	select @errorResult = 0;
	select @hFilterXml = null;

	begin try
		declare @tags table
		(
			TagId int not null primary key,
			Position int not null
		);
		declare @startTime smalldatetime;
		declare @endTime smalldatetime;
		declare @resolution tinyint;
		declare @timezoneOffsetInMinutes smallint;

		declare @startTimeLocal smalldatetime;
		declare @endTimeLocal smalldatetime;
		declare @i int;

		declare @solutionFilterThreshold int;
		declare @showBuiltInSolutionsOnOverview int;
		declare @useSnapshots int;

		declare @numSolutionsInSnapshot int;

		declare @dataPointTimestamps table
		(
			TimestampLocal smalldatetime not null primary key
		);

		create table #results
		(
			TimestampLocal datetime not null primary key,
			NumPassingSolutions int,
			NumFailingSolutions int
		);

		declare @snapshotResolution int;
		declare @isFiltered bit;

		if @filterXml is not null
		begin
			exec sp_xml_preparedocument @hFilterXml output, @filterXml;

			insert @tags ( TagId, Position )
			select
				T.TagId,
				X.Position
			from
				Tags T
				inner join openxml(@hFilterXml, '/params/filters/userfilters/tags/tag', 1) with
				(
					Tag nvarchar(32) '@value',
					Position int '../@pos'
				) X on X.Tag = T.Tag;
		end

		exec GetEventFiltersFromXml @hFilterXml, @startTime output, @endTime output, null, null;
		exec GetOutputParametersFromXml @hFilterXml, @timezoneOffsetInMinutes output, @resolution output;

		select
			@startTimeLocal = (DATEADD(DAY, DATEDIFF(DAY, 0, dateadd(minute, @timezoneOffsetInMinutes, @startTime)), 0)),
			@endTimeLocal = dateadd(minute, @timezoneOffsetInMinutes, @endTime);

		select 
			@solutionFilterThreshold = isnull((select IntValue from ServerSettings where Name = 'SolutionFilterThreshold'), 0),
			@showBuiltInSolutionsOnOverview = isnull((select IntValue from ServerSettings where Name = 'ShowBuiltInSolutionsOnOverview'), 0),
			@useSnapshots = isnull((select IntValue from ServerSettings where Name = 'EnableUsageSnapshots'), 0);

		select @numSolutionsInSnapshot = (case when @view = 0 then 400 else 100 end);

		select @i = 1;

		while (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 1 THEN DATEADD(DAY, -7 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 2 THEN DATEADD(MONTH, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 3 THEN DATEADD(MONTH, -3 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 4 THEN DATEADD(MONTH, -6 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) ELSE DATEADD(YEAR, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) END) >= @startTimeLocal
		begin
			insert @dataPointTimestamps ( TimestampLocal ) values ( (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 1 THEN DATEADD(DAY, -7 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 2 THEN DATEADD(MONTH, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 3 THEN DATEADD(MONTH, -3 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) WHEN 4 THEN DATEADD(MONTH, -6 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) ELSE DATEADD(YEAR, -1 * @i, (DATEADD(DAY, DATEDIFF(DAY, 0, @endTimeLocal), 0))) END) );

			select @i = @i + 1;
		end;

		with _FilteredSolutionHealthSnapshots as
		(
			select
				TimestampLocal = dateadd(minute, @timezoneOffsetInMinutes, SHS.Timestamp),
				SHS.Resolution,
				SHS.Tag1Id,
				SHS.Tag2Id,
				SHS.Tag3Id,
				SHS.Tag4Id,
				SHS.SolutionId,
				SHS.NumSessions,
				SHS.NumSuccessfulSessions
			from
				SolutionHealthSnapshots SHS
			where
				(SHS.Resolution = @resolution)
				and (not exists (select * from @tags where Position = 1) or exists (select * from @tags where Position = 1 and TagId = SHS.Tag1Id))
				and (not exists (select * from @tags where Position = 2) or exists (select * from @tags where Position = 2 and TagId = SHS.Tag2Id))
				and (not exists (select * from @tags where Position = 3) or exists (select * from @tags where Position = 3 and TagId = SHS.Tag3Id))
				and (not exists (select * from @tags where Position = 4) or exists (select * from @tags where Position = 4 and TagId = SHS.Tag4Id))
				and SHS.Timestamp > dateadd(minute, -@timezoneOffsetInMinutes, @startTimeLocal)
				and SHS.Timestamp <= dateadd(minute, -@timezoneOffsetInMinutes, @endTimeLocal)
				and (SHS.ViewType = @view)
		),
		_LastSnapshotTimestampPerDay as
		(

			select
				TimestampLocal = max(FSHS.TimestampLocal)
			from
				_FilteredSolutionHealthSnapshots FSHS
			group by
				(DATEADD(DAY, DATEDIFF(DAY, 0, FSHS.TimestampLocal), 0))
		),
		_SolutionStatsPerTimestamp as
		(
			select
				FSHS.TimestampLocal,
				FSHS.SolutionId,
				SuccessPercent = (CAST(sum(FSHS.NumSuccessfulSessions) AS FLOAT) / CAST(sum(FSHS.NumSessions) AS FLOAT) * 100.0),
				RowNumber = row_number() over (partition by FSHS.TimestampLocal order by sum(FSHS.NumSessions) desc, FSHS.SolutionId asc)
			from
				_FilteredSolutionHealthSnapshots FSHS
			group by
				FSHS.TimestampLocal,
				FSHS.SolutionId
		)
		insert [#results]
		(
			TimestampLocal,
			NumPassingSolutions,
			NumFailingSolutions
		)
		select
			TimestampLocal = SSPT.TimestampLocal,
			NumPassingSolutions = sum(case when SuccessPercent >= @successRateGoal then 1 else 0 end),
			NumFailingSolutions = sum(case when SuccessPercent >= @successRateGoal then 0 else 1 end)
		from
			@dataPointTimestamps DPT
			inner join _LastSnapshotTimestampPerDay LSTPD on (DATEADD(DAY, DATEDIFF(DAY, 0, LSTPD.TimestampLocal), 0)) = (DATEADD(DAY, DATEDIFF(DAY, 0, DPT.TimestampLocal), 0))
			inner join _SolutionStatsPerTimestamp SSPT on SSPT.TimestampLocal = LSTPD.TimestampLocal
		where
			SSPT.RowNumber <= @numSolutionsInSnapshot
		group by
			SSPT.TimestampLocal;

		insert [#results]
		(
			TimestampLocal,
			NumPassingSolutions,
			NumFailingSolutions
		)
		select
			TimestampLocal = DPT.TimestampLocal,
			NumPassingSolutions = 0,
			NumFailingSolutions = 0
		from
			@dataPointTimestamps DPT
		where
			not exists (select * from [#results] R where (DATEADD(DAY, DATEDIFF(DAY, 0, R.TimestampLocal), 0)) = (DATEADD(DAY, DATEDIFF(DAY, 0, DPT.TimestampLocal), 0)));

		select @startTimeLocal = (CASE (@resolution) WHEN 0 THEN DATEADD(DAY, -1 * 1, @endTimeLocal) WHEN 1 THEN DATEADD(DAY, -7 * 1, @endTimeLocal) WHEN 2 THEN DATEADD(MONTH, -1 * 1, @endTimeLocal) WHEN 3 THEN DATEADD(MONTH, -3 * 1, @endTimeLocal) WHEN 4 THEN DATEADD(MONTH, -6 * 1, @endTimeLocal) ELSE DATEADD(YEAR, -1 * 1, @endTimeLocal) END);

		create table [#filteredUsers]
		(
			UserId int not null primary key,
		);

		insert [#filteredUsers] ( UserId )
		exec @isFiltered = FilterUsers @hFilterXml, 1;
		if @isFiltered = 0
		begin
			drop table [#filteredUsers];
		end;

		if @useSnapshots = 1 and @resolution in (3, 4, 5)
		begin
			select @snapshotResolution = @resolution;
		end;

		if @snapshotResolution is not null
		begin

			if @isFiltered = 1
			begin

				with _FilteredSolutions as
				(
					select
						S.SolutionId
					from
						Solutions S
					where
						(S.ApplicationId in (0, 1, 2, 4))
						and (((@view = 0) and (S.SolutionType in (0, 1)))
							or ((@view = 1) and (S.SolutionType in (2, 3, 4))))
						and ((@solutionFilterThreshold = 0)
							or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

						and ((@showBuiltInSolutionsOnOverview = 1)
							or (not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
								and not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId)))
				),
				_SolutionStats as
				(

					select top (@numSolutionsInSnapshot)
						SSPU.SolutionId,
						NumSessions = sum(SSPU.NumSessions),
						NumSuccessfulSessions = sum(SSPU.NumSuccessfulSessions)
					from
						SolutionSummariesPerUser SSPU with (nolock)

						inner join [#filteredUsers] FU on FU.UserId = SSPU.UserId

						inner join _FilteredSolutions FS on FS.SolutionId = SSPU.SolutionId
					where
						SSPU.Resolution = @snapshotResolution
						and SSPU.NumSessions <> 0
					group by
						SSPU.SolutionId
					order by
						sum(SSPU.NumSessions) desc, SSPU.SolutionId asc

				)				
				insert [#results]
				(
					TimestampLocal,
					NumPassingSolutions,
					NumFailingSolutions
				)
				select
					TimestampLocal = @endTimeLocal,
					NumPassingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 1 else 0 end),
					NumFailingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 0 else 1 end)
				from
					_SolutionStats;

			end;
			else
			begin

				with _FilteredSolutions as
				(
					select
						S.SolutionId
					from
						Solutions S
					where
						(S.ApplicationId in (0, 1, 2, 4))
						and (((@view = 0) and (S.SolutionType in (0, 1)))
							or ((@view = 1) and (S.SolutionType in (2, 3, 4))))
						and ((@solutionFilterThreshold = 0)
							or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

						and ((@showBuiltInSolutionsOnOverview = 1)
							or (not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
								and not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId)))
				),
				_SolutionStats as
				(

					select top (@numSolutionsInSnapshot)
						SSPU.SolutionId,
						NumSessions = sum(SSPU.NumSessions),
						NumSuccessfulSessions = sum(SSPU.NumSuccessfulSessions)
					from
						SolutionSummariesPerUser SSPU with (nolock)

						inner join _FilteredSolutions FS on FS.SolutionId = SSPU.SolutionId
					where
						SSPU.Resolution = @snapshotResolution
						and SSPU.NumSessions <> 0
					group by
						SSPU.SolutionId
					order by
						sum(SSPU.NumSessions) desc, SSPU.SolutionId asc

				)				
				insert [#results]
				(
					TimestampLocal,
					NumPassingSolutions,
					NumFailingSolutions
				)
				select
					TimestampLocal = @endTimeLocal,
					NumPassingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 1 else 0 end),
					NumFailingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 0 else 1 end)
				from
					_SolutionStats;

			end;

			select
				R.TimestampLocal,
				NumPassingSolutions = isnull(R.NumPassingSolutions, 0),
				NumFailingSolutions = isnull(R.NumFailingSolutions, 0)
			from
				[#results] R
			order by
				R.TimestampLocal asc;

		end;
		else
		begin

			if @isFiltered = 1
			begin

				with _FilteredSolutions as
				(
					select
						S.SolutionId
					from
						Solutions S
					where
						(S.ApplicationId in (0, 1, 2, 4))
						and (((@view = 0) and (S.SolutionType in (0, 1)))
							or ((@view = 1) and (S.SolutionType in (2, 3, 4))))
						and ((@solutionFilterThreshold = 0)
							or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

						and ((@showBuiltInSolutionsOnOverview = 1)
							or (not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
								and not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId)))
				),
				_SolutionStats as
				(

					select top (@numSolutionsInSnapshot)
						SS.SolutionId,
						NumSessions = count(*),
						NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)	
					from
						SolutionSessions SS

						inner join [#filteredUsers] FU on FU.UserId = SS.UserId

						inner join _FilteredSolutions FS on FS.SolutionId = SS.SolutionId
					where
						(SS.SessionStartTime > dateadd(minute, -@timezoneOffsetInMinutes, @startTimeLocal))
						and (SS.SessionStartTime <= dateadd(minute, -@timezoneOffsetInMinutes, @endTimeLocal))
					group by
						SS.SolutionId
					order by
						count(*) desc, SS.SolutionId asc

				)				
				insert [#results]
				(
					TimestampLocal,
					NumPassingSolutions,
					NumFailingSolutions
				)
				select
					TimestampLocal = @endTimeLocal,
					NumPassingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 1 else 0 end),
					NumFailingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 0 else 1 end)
				from
					_SolutionStats;

			end;
			else
			begin

				with _FilteredSolutions as
				(
					select
						S.SolutionId
					from
						Solutions S
					where
						(S.ApplicationId in (0, 1, 2, 4))
						and (((@view = 0) and (S.SolutionType in (0, 1)))
							or ((@view = 1) and (S.SolutionType in (2, 3, 4))))
						and ((@solutionFilterThreshold = 0)
							or ((select count(distinct SI.UserId) from SolutionInstances SI with (index (IX_SolutionInstances_SolutionId_LastSeenTime__LoadTimeInMilliseconds)) where SI.SolutionId = S.SolutionId) >= @solutionFilterThreshold))

						and ((@showBuiltInSolutionsOnOverview = 1)
							or (not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName = S.FileName and BIS.ProgId is null)
								and not exists (select * from BuiltInSolutions BIS where BIS.IsEnabled = 1 and BIS.SolutionType = S.SolutionType and BIS.FileName is null and BIS.ProgId = S.ProgId)))
				),
				_SolutionStats as
				(

					select top (@numSolutionsInSnapshot)
						SS.SolutionId,
						NumSessions = count(*),
						NumSuccessfulSessions = sum(case when SS.State = 1 then 0 else 1 end)	
					from
						SolutionSessions SS

						inner join _FilteredSolutions FS on FS.SolutionId = SS.SolutionId
					where
						(SS.SessionStartTime > dateadd(minute, -@timezoneOffsetInMinutes, @startTimeLocal))
						and (SS.SessionStartTime <= dateadd(minute, -@timezoneOffsetInMinutes, @endTimeLocal))
					group by
						SS.SolutionId
					order by
						count(*) desc, SS.SolutionId asc

				)				
				insert [#results]
				(
					TimestampLocal,
					NumPassingSolutions,
					NumFailingSolutions
				)
				select
					TimestampLocal = @endTimeLocal,
					NumPassingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 1 else 0 end),
					NumFailingSolutions = sum(case when (CAST(NumSuccessfulSessions AS FLOAT) / CAST(NumSessions AS FLOAT) * 100.0) >= @successRateGoal then 0 else 1 end)
				from
					_SolutionStats;

			end;

			select
				R.TimestampLocal,
				NumPassingSolutions = isnull(R.NumPassingSolutions, 0),
				NumFailingSolutions = isnull(R.NumFailingSolutions, 0)
			from
				[#results] R
			order by
				R.TimestampLocal asc;

		end;
	end try
	begin catch
		select @errorResult = error_number();
	end catch

	if @hFilterXml is not null
	begin
		exec sp_xml_removedocument @hFilterXml;
	end

	return @errorResult;
end
go

