create view dbo.Events
as
select
	[Event ID] = EI.EventInstanceId,
	[Issue ID] = EI.EventId,
	[Inventory ID] = (cast(cast(EI.SolutionId as binary(4)) + cast(EI.UserId as binary(4)) + cast(EI.ComputerId as binary(4)) as uniqueidentifier)),
	[Solution ID] = EI.SolutionId,
	[User ID] = EI.UserId,
	[Computer ID] = EI.ComputerId,
	[Event date] = EI.Timestamp,
	[Application version (detail)] = ((CAST((CAST(EI.HostAppVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(EI.HostAppVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(EI.HostAppVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(EI.HostAppVersionRevision as int) + 65536) % 65536 as nvarchar))
from
	dbo.EventInstances EI
	inner join dbo.VFilteredSolutions S on S.SolutionId = EI.SolutionId
where
	S.SolutionType in (0, 1, 2, 3, 4)
	and EI.Timestamp >= dateadd(month, -3, getutcdate())
