create view dbo.Inventory
as
select
	[Inventory ID] = (cast(cast(SI.SolutionId as binary(4)) + cast(SI.UserId as binary(4)) + cast(SI.ComputerId as binary(4)) as uniqueidentifier)),
	[Solution ID] = SI.SolutionId,
	[User ID] = SI.UserId,
	[Computer ID] = SI.ComputerId,
	[Friendly name] = SI.FriendlyName,
	[Location] = SI.FullPath,
	[Load time (seconds)] = (cast(SI.LoadTimeInMilliseconds as float) / 1000.0),
	[Title] = SI.Title,
	[Author] = SI.Author,
	[CPU architecture] =
		(
			case SI.CpuArchitecture
				when 9 then N'x64'
				when 5 then N'ARM'
				else N'x86'
			end
		),
	[Solution version] = ((CAST((CAST(SI.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(SI.VersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Load behavior] = SI.LoadBehavior,
	[File size (bytes)] = SI.FileSizeInBytes,
	[Has VBA] = SI.HasVba,
	[Has OLE] = SI.HasOle,
	[Has external data connection] = SI.HasExternalDataConnections,
	[Has ActiveX control] = SI.HasActiveXControl,
	[Has assembly reference] = SI.HasAssemblyReference,
	[Has XML schema] = SI.HasXmlSchema,
	[Has XML expansion pack] = SI.HasXmlExpansionPack,
	[Last loaded] = SI.LastLoadedTime,
	[Last scanned] = SI.LastSeenTime
from
	VFilteredSolutionInstances SI
	inner join Solutions S on S.SolutionId = SI.SolutionId
where
	S.SolutionType in (0, 1, 2, 3, 4)
