IF EXISTS(SELECT * FROM sys.views WHERE name = N'Lookup_solutions') BEGIN DROP VIEW [Lookup_solutions]; END;
go

create view dbo.Lookup_solutions
as
select
	[Solution ID] = S.SolutionId,
	[Solution type] =
		case S.SolutionType
			when 0 then N'Document'
			when 1 then N'Template'
			when 2 then N'Add-in'
			when 3 then N'COM add-in'
			when 4 then N'App'
			else null
		end,
	[Application] =
		case S.ApplicationId
			when 0 then N'Word'
			when 1 then N'Excel'
			when 2 then N'PowerPoint'
			when 3 then N'Access'
			when 4 then N'Outlook'
			when 5 then N'SharePoint Workspace'
			when 6 then N'InfoPath'
			when 7 then N'OneNote'
			when 8 then N'Project'
			when 9 then N'Publisher'
			when 10 then N'Visio'
			when 11 then N'SharePoint Designer'
			else null
		end,
	[Solution name] =
		case
			when S.SolutionType in (0, 1) then (CASE WHEN S.MaskedFileName IS NULL THEN S.FileName ELSE REPLACE(S.MaskedFileName, N'*', N'********(' + CAST(S.MaskedFileDisplayNumber AS NVARCHAR) + N')') END)
			when S.SolutionType = 4 then isnull(S.FileName, S.ProgId) collate Latin1_General_CI_AS_KS_WS
			else isnull(S.ProgId, S.FileName) collate Latin1_General_CI_AS_KS_WS
		end,
	[File name] = (CASE WHEN S.MaskedFileName IS NULL THEN S.FileName ELSE REPLACE(S.MaskedFileName, N'*', N'********(' + CAST(S.MaskedFileDisplayNumber AS NVARCHAR) + N')') END),
	[ProgID] = S.ProgId,
	[Publisher] = S.Publisher
from
	VFilteredSolutions S
where
	S.SolutionType in (0, 1, 2, 3, 4)
go

