IF EXISTS(SELECT * FROM sys.views WHERE name = N'Lookup_computers') BEGIN DROP VIEW [Lookup_computers]; END;
go

create view dbo.Lookup_computers
as
select
	[Computer ID] = C.ComputerId,
	[Computer name] = C.ComputerName,
	[Computer domain] = C.ComputerDomain,
	[Telemetry Agent version] = ((CAST((CAST(C.AgentVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.AgentVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.AgentVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(C.AgentVersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Computer processor name] = C.ProcessorName,
	[Number of processors (logical)] = C.NumProcessorsLogical,
	[Number of processors (physical)] = C.NumProcessorsPhysical,
	[System type] =
		(
			case C.CpuArchitecture
				when 9 then N'x64-based PC'
				when 5 then N'ARM-based PC'
				else N'x86-based PC'
			end
		),
	[Computer installed memory] = C.MemoryInMB,
	[Display resolution] = (case when (C.ScreenHeight = 0) and (C.ScreenWidth = 0) then null else cast(C.ScreenWidth as nvarchar) + N' x ' + cast(C.ScreenHeight as nvarchar) end),
	[Display resolution (width)] = (CASE WHEN (C.ScreenWidth) = 0 THEN NULL ELSE (C.ScreenWidth) END),
	[Display resolution (height)] = (CASE WHEN (C.ScreenHeight) = 0 THEN NULL ELSE (C.ScreenHeight) END),
	[Windows version] =
		isnull(
			(
				select top 1 DisplayName from WindowsVersionDefinitions
				where
					((CpuArchitecture is null) or (C.CpuArchitecture = CpuArchitecture))
					and ((StartVersionMajor is null) or (C.OSVersionMajor > StartVersionMajor) or ((C.OSVersionMajor = StartVersionMajor)
						and ((StartVersionMinor is null) or (C.OSVersionMinor > StartVersionMinor) or ((C.OSVersionMinor = StartVersionMinor)
							and ((StartVersionBuild is null) or (C.OSVersionBuild >= StartVersionBuild))))))
					and ((ProductType is null) or (C.OSProductType = ProductType))
				order by SearchOrder asc
			),
			case
				when C.OSProductType in (2, 3) then N'Windows Server '
				else N'Windows '
			end
			+ N'(' + (CAST((CAST(C.OSVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.OSVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.OSVersionBuild as int) + 65536) % 65536 as nvarchar)) + N')'
		),
	[Windows version (detail)] = (CAST((CAST(C.OSVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.OSVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.OSVersionBuild as int) + 65536) % 65536 as nvarchar)),
	[Windows system locale] = isnull(SDL.DisplayName, cast(C.OSDefaultLangId as nvarchar)),
	[Windows system display language] = isnull(SDUI.DisplayName, cast(C.OSDefaultUILangId as nvarchar)),
	[IE version] = N'IE ' + cast(C.IEVersionMajor as nvarchar),
	[IE version (detail)] = ((CAST((CAST(C.IEVersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.IEVersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(C.IEVersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(C.IEVersionRevision as int) + 65536) % 65536 as nvarchar))

from
	Computers C
	left outer join dbo.LcidDefinitions SDL on SDL.LCID = C.OSDefaultLangId
	left outer join dbo.LcidDefinitions SDUI on SDUI.LCID = C.OSDefaultUILangId
go

IF EXISTS(SELECT * FROM sys.views WHERE name = N'System_details') BEGIN DROP VIEW [System_details]; END;
go

create view dbo.System_details
as
with _LatestOfficeVersions as
(
	select * from
		(
			select
				SI.ComputerId,
				SI.UserId,
				SI.VersionMajor,
				SI.VersionMinor,
				SI.VersionBuild,
				SI.VersionRevision,
				RowNumber = row_number() over (partition by SI.ComputerId, SI.UserId, SI.VersionMajor order by SI.LastSeenTime desc)
			from
				SolutionInstances SI
				inner join Solutions S on S.SolutionId = SI.SolutionId
			where
				S.SolutionType = 6
		) X
	where
		X.RowNumber = 1
)
select
	[Computer name] = C.[Computer name],
	[Computer domain] = C.[Computer domain],
	[User name] = U.UserName,
	[User domain] = U.UserDomain,
	[Label 1] = T1.Tag,
	[Label 2] = T2.Tag,
	[Label 3] = T3.Tag,
	[Label 4] = T4.Tag,
	[Telemetry Agent version] = C.[Telemetry Agent version],
	[Telemetry Processor (file share)] = UOC.FileShare,
	[Telemetry Processor (computer)] = UOC.DataProcessorName,
	[Computer processor name] = C.[Computer processor name],
	[Number of processors (logical)] = C.[Number of processors (logical)],
	[Number of processors (physical)] = C.[Number of processors (physical)],
	[System type] = C.[System type],
	[Computer installed memory] = C.[Computer installed memory],
	[Display resolution] = C.[Display resolution],
	[Display resolution (width)] = C.[Display resolution (width)],
	[Display resolution (height)] = C.[Display resolution (height)],
	[Windows version] = C.[Windows version],
	[Windows version (detail)] = C.[Windows version (detail)],
	[Windows system locale] = C.[Windows system locale],
	[Windows system display language] = C.[Windows system display language],
	[IE version] = C.[IE version],
	[IE version (detail)] = C.[IE version (detail)],
	[Windows system locale (user)] = isnull(UDL.DisplayName, cast(UOC.WindowsUserDefaultLangId as nvarchar)),
	[Windows display language (user)] = isnull(UDUI.DisplayName, cast(UOC.WindowsUserDefaultUILangId as nvarchar)),
	[Last scanned] = UOC.LastScanTime,
	[Office 2003] = ((CAST((CAST(LOV11.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV11.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV11.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(LOV11.VersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Office 2007] = ((CAST((CAST(LOV12.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV12.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV12.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(LOV12.VersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Office 2010] = ((CAST((CAST(LOV14.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV14.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV14.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(LOV14.VersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Office 15] = ((CAST((CAST(LOV15.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV15.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV15.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(LOV15.VersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Office 16] = ((CAST((CAST(LOV16.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV16.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(LOV16.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(LOV16.VersionRevision as int) + 65536) % 65536 as nvarchar))
from
	dbo.UsersOnComputers UOC
	inner join dbo.Users U on U.UserId = UOC.UserId
	inner join dbo.Lookup_computers C on C.[Computer ID] = UOC.ComputerId
	left outer join dbo.Tags T1 on T1.TagId = U.Tag1Id
	left outer join dbo.Tags T2 on T2.TagId = U.Tag2Id
	left outer join dbo.Tags T3 on T3.TagId = U.Tag3Id
	left outer join dbo.Tags T4 on T4.TagId = U.Tag4Id
	left outer join dbo.LcidDefinitions UDL on UDL.LCID = UOC.WindowsUserDefaultLangId
	left outer join dbo.LcidDefinitions UDUI on UDUI.LCID = UOC.WindowsUserDefaultUILangId
	left outer join _LatestOfficeVersions LOV11 on LOV11.UserId = UOC.UserId and LOV11.ComputerId = UOC.ComputerId and LOV11.VersionMajor = 11
	left outer join _LatestOfficeVersions LOV12 on LOV12.UserId = UOC.UserId and LOV12.ComputerId = UOC.ComputerId and LOV12.VersionMajor = 12
	left outer join _LatestOfficeVersions LOV14 on LOV14.UserId = UOC.UserId and LOV14.ComputerId = UOC.ComputerId and LOV14.VersionMajor = 14
	left outer join _LatestOfficeVersions LOV15 on LOV15.UserId = UOC.UserId and LOV15.ComputerId = UOC.ComputerId and LOV15.VersionMajor = 15
	left outer join _LatestOfficeVersions LOV16 on LOV16.UserId = UOC.UserId and LOV16.ComputerId = UOC.ComputerId and LOV16.VersionMajor = 16
go

IF EXISTS(SELECT * FROM sys.views WHERE name = N'Usage_summary') BEGIN DROP VIEW [Usage_summary]; END;
go

create view dbo.Usage_summary
as
select
	[Inventory ID] = (cast(cast(SS.SolutionId as binary(4)) + cast(SS.UserId as binary(4)) + cast(SS.ComputerId as binary(4)) as uniqueidentifier)),
	[Solution ID] = SS.SolutionId,
	[User ID] = SS.UserId,
	[Computer ID] = SS.ComputerId,
	[Total session (last 7 days)] = isnull(sum(case when SS.SessionStartTime >= dateadd(day, -7, getutcdate()) then 1 else 0 end), 0),
	[Total session (last 1 month)] = isnull(sum(case when SS.SessionStartTime >= dateadd(month, -1, getutcdate()) then 1 else 0 end), 0),
	[Total session (last 3 months)] = count(*),		
	[Failed session (last 7 days)] = isnull(sum(case when (SS.SessionStartTime >= dateadd(day, -7, getutcdate())) and (SS.State = 1) then 1 else 0 end), 0),
	[Failed session (last 1 month)] = isnull(sum(case when (SS.SessionStartTime >= dateadd(month, -1, getutcdate())) and (SS.State = 1) then 1 else 0 end), 0),
	[Failed session (last 3 months)] = isnull(sum(case when SS.State = 1 then 1 else 0 end), 0)		
from
	dbo.VFilteredSolutions S
	inner join dbo.SolutionSessions SS on SS.SolutionId = S.SolutionId
where
	S.SolutionType in (0, 1, 2, 3, 4)
	and SS.SessionStartTime >= dateadd(month, -3, getutcdate())
group by
	SS.SolutionId, SS.UserId, SS.ComputerId
go

IF EXISTS(SELECT * FROM sys.views WHERE name = N'Issue_summary') BEGIN DROP VIEW [Issue_summary]; END;
go

create view dbo.Issue_summary
as
select
	[Issue ID] = EI.EventId,
	[Inventory ID] = (cast(cast(EI.SolutionId as binary(4)) + cast(EI.UserId as binary(4)) + cast(EI.ComputerId as binary(4)) as uniqueidentifier)),
	[Solution ID] = EI.SolutionId,
	[User ID] = EI.UserId,
	[Computer ID] = EI.ComputerId,
	[Number of instances (last 7 days)] = isnull(sum(case when EI.Timestamp >= dateadd(day, -7, getutcdate()) then 1 else 0 end), 0),
	[Number of instances (last 1 month)] = isnull(sum(case when EI.Timestamp >= dateadd(month, -1, getutcdate()) then 1 else 0 end), 0),
	[Number of instances (last 3 months)] = count(*)			
from
	dbo.EventInstances EI
	inner join dbo.VFilteredSolutions S on S.SolutionId = EI.SolutionId
where
	S.SolutionType in (0, 1, 2, 3, 4)
	and EI.Timestamp >= dateadd(month, -3, getutcdate())
group by
	EI.EventId, EI.SolutionId, EI.UserId, EI.ComputerId
go

IF EXISTS(SELECT * FROM sys.views WHERE name = N'App_sessions') BEGIN DROP VIEW [App_sessions]; END;
go

create view dbo.App_sessions
as
select
	[Session date] = SS.SessionStartTime,
	[User name] = U.UserName,
	[User domain] = U.UserDomain,
	[Computer name] = C.ComputerName,
	[Computer domain] = C.ComputerDomain,
	[App name] = S.FileName,
	[App ID] = S.ProgId,
	[App version] = ((CAST((CAST(SI.VersionMajor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionMinor as int) + 65536) % 65536 as nvarchar) + N'.' + CAST((CAST(SI.VersionBuild as int) + 65536) % 65536 as nvarchar)) + N'.' + CAST((CAST(SI.VersionRevision as int) + 65536) % 65536 as nvarchar)),
	[Document file name] = (CASE WHEN CS.MaskedFileName IS NULL THEN CS.FileName ELSE REPLACE(CS.MaskedFileName, N'*', N'********(' + CAST(CS.MaskedFileDisplayNumber AS NVARCHAR) + N')') END),
	[Document location] = CSI.FullPath,
	[Application] =
		case S.ApplicationId
			when 0 then N'Word'
			when 1 then N'Excel'
			when 2 then N'PowerPoint'
			when 3 then N'Access'
			when 4 then N'Outlook'
			when 5 then N'SharePoint Workspace'
			when 6 then N'InfoPath'
			when 7 then N'OneNote'
			when 8 then N'Project'
			when 9 then N'Publisher'
			when 10 then N'Visio'
			when 11 then N'SharePoint Designer'
			else null
		end,
	[Severity] = SS.State
from
	SolutionSessions SS
	inner join Solutions S on S.SolutionId = SS.SolutionId
	inner join Users U on U.UserId = SS.UserId
	inner join Computers C on C.ComputerId = SS.ComputerId
	left outer join SolutionInstances SI on SI.SolutionId = SS.SolutionId and SI.UserId = SS.UserId and SI.ComputerId = SS.ComputerId
	left outer join SolutionSessionDetails SSD on SSD.SessionStartTime = SS.SessionStartTime and SSD.SolutionId = SS.SolutionId and SSD.UserId = SS.UserId and SSD.ComputerId = SS.ComputerId
	left outer join Solutions CS on CS.SolutionId = SSD.ContainerSolutionId
	left outer join SolutionInstances CSI on CSI.SolutionId = SSD.ContainerSolutionId and SI.UserId = SSD.UserId and SI.ComputerId = SSD.ComputerId
where
	S.SolutionType = 4;
go

