	X.ProgId,
	0
from
	#builtInSolutionsTemp X
where
	not exists
	(
		select *
		from BuiltInSolutions BIS
		where
			BIS.SolutionType = X.SolutionType
			and (BIS.FileName = X.FileName or BIS.ProgId = X.ProgId)
	);
go

drop table #builtInSolutionsTemp;
